(1, 0, 'Судьба/Апокриф', 'Fate/Apocrypha', 25, '8.5', '1,2', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Ffateapokrif%2F%5BKANSAI%5D_Fate_-_Apocrypha_%5B720p%5D.torrent?alt=media&token=bc705951-9d8a-467f-a4b4-212808600f5c\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fsudba-apokrif%2Fthumbnail.webp?alt=media&token=db7cb11c-b10f-461a-b8ac-bcf20a648dc6', 'События происходят в альтернативной вселенной, в которой Великий Грааль  загадочно исчезает после Третьей Войны. Спустя много лет клан магов Иггдмилления заявляет о своем выходе из Ассоциации Магов и о том, что именно в их руках находится Грааль. В городе Трифас сталкиваются две противоборствующие стороны в битве за право владеть священной реликвией. Чёрная фракция, маги семьи Иггдмилления, и Красная фракция — наёмники Ассоциации. С каждой стороны выступают семь Слуг и семь Мастеров. Сам Грааль призывает Слугу класса Рулер в качестве наблюдателя конфликта. Это - начало Великой Войны Святого Грааля.', '2018-06-11 21:23:46', 9341, 0, 'sudba-apokrif', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(2, 0, 'ВакФу (3 сезон)', 'WakFu TV3', 13, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2029%20Wakfu%2F%D0%BA%D0%B5%D0%B2%D0%BA%D0%B5%D1%80.webp?alt=media&token=da6214ce-56b0-43c6-a375-4482330a3b77', 'Победители Нокса и Огреста, Пинпин и Эвангелин, уже долгие годы воюют лишь с посудой да грязными пелёнками. Их мирной жизни приходит конец, когда их бывший союзник разрушает их дом и разлучает семью. Что толкнуло друга на предательство? Что кроется в таинственной башне, на вершине которой героев ждут любимые?', '2018-06-11 11:59:06', 3720, 0, 'vakfu-3-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(3, 0, 'Сказания о Конохане', 'Konohana no Kitan', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fskazaniya-o-konokhane%2Ftorrent-720.torrent?alt=media&token=207f43e8-df30-4e7c-b1d0-64702acc9c8e\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fskazaniya-o-konokhane%2Ftorrent-1080.torrent?alt=media&token=274b1ad9-21ca-4110-b5a2-3be32e3264de\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fskazaniya-o-konokhane%2Fthumbnail.webp?alt=media&token=e719b4a2-e933-4b7d-8233-224a303972fe', 'В деревне, населённой мифическими существами живут духи-лисы, работающие в гостинице при горячих источниках. Сюжет развернётся вокруг новой работницы Юзу. Раньше Юзу жила в горах, но затем решила начать новую жизнь в первоклассной гостинице. Она забывчива и неуклюжа, но при этом очень мила, что позволяет ей найти общий язык с коллегами.', '2018-06-11 11:59:06', 1710, 0, 'skazaniya-o-konokhane', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(4, 0, 'Альтаир', 'Shoukoku no Altair', 24, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F%D0%90%D0%BB%D1%8C%D1%82%D0%B0%D0%B8%D1%80%2F0-121353372005962a25e99c0f6.00032540.jpg?alt=media&token=8dfb6188-cbf4-4281-92a2-660e03ccc09e', 'Махмут Тогрул — юный паша, один из руководителей турецкой военной диктатуры. Над государством начинают сгущаться тучи, когда его стране начинает угрожать соседняя агрессивная Империя. Военные чиновники разделились на два лагеря: одни рвутся в бой, другие — ратуют за мир. Перед Махмутом встает сверхсложная задача сохранить мир любой ценой. Все глубже и глубже погружаясь в политику древнего мира, Махмут находит как новых врагов, так и новых союзников. Кто одержит верх? Что будет делать Махмут, если война все же станет неизбежной?', '2018-06-11 11:59:07', 4690, 0, 'altair', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(5, 0, 'Боруто: Фильм Наруто', 'Boruto: Naruto the Movie', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8C%2Fboruto-film-naruto%2Fthumbnail.webp?alt=media&token=e7406cd2-b49a-47a0-8c4d-66c9d5cf2afb', 'Боруто Узумаки — сын Наруто Узумаки, героя Деревни Скрытого Листа. Сынишка весьма одарен, но он ненавидит своего отца за то, что тот, будучи Седьмым Хокаге, уделяет больше времени работе, нежели семье. Боруто хочет превзойти героический путь отца, и лучшей идеей для этого становится намерение стать учеником его лучшего друга и соперника - Саске Учихи. Наступает новая эпоха - эпоха следующего поколения шиноби!\n', '2018-06-11 11:59:07', 1784, 0, 'boruto-film-naruto', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2015,\"ishidden\":\"on\"}]'),
(6, 0, 'Код Гиасс: Восставший Лелуш', 'Code Geass: Hangyaku no Lelouch', 2, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8C%2Fkod-giass-vosstavshiy-lelush%2Fthumbnail.webp?alt=media&token=3e7501de-6d41-4e6f-9a2d-8e67be139999', 'Альтернативная реальность: Британская Империя захватила треть мира, обрушивая на непокорных мощь своей военной машины.\n\nВ Японии, захваченной и переименованной в «Зону 11», вместе с младшей сестрой живёт старшеклассник Лелуш – изгнанный сын Императора, потерявший мать и право на престол. Юноша отличается от сверстников не только происхождением – он весьма одарённая личность, только где применить эти способности? Неожиданно Лелуш оказывается вовлечён в столкновение между японскими террористами и британскими солдатами. Так он знакомится с загадочной девушкой «C.C.» Она дарует ему сверхъестественную способность «Гиасс», позволяющую подчинять себе волю других людей.\n\nСкрыв своё лицо маской, под именем «Зеро» Лелуш присоединяется к подпольному движению, горя желанием отомстить Британии и отцу. Будучи студентом Академии Ашфорд, юноша вынужден вести двойную жизнь. Но не ему одному приходится скрывать своё лицо и свои подлинные цели от окружающих...', '2018-06-11 11:59:08', 3123, 0, 'kod-giass-vosstavshiy-lelush', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2006,\"ishidden\":\"on\"}]'),
(7, 0, 'Тревоги кентавра', 'Centaur no Nayami', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F%D0%A2%D1%80%D0%B5%D0%B2%D0%BE%D0%B3%D0%B8%20%D0%BA%D0%B5%D0%BD%D1%82%D0%B0%D0%B2%D1%80%D0%B0%2FKANSAI_Centaur_no_Nayami_720p_torrent.torrent?alt=media&token=99f2a4a7-cdd6-4867-a45e-f48fc4f5785d\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F%D0%A2%D1%80%D0%B5%D0%B2%D0%BE%D0%B3%D0%B8%20%D0%BA%D0%B5%D0%BD%D1%82%D0%B0%D0%B2%D1%80%D0%B0%2FKANSAI_Centaur_no_Nayami_1080p_torrent.torrent?alt=media&token=ea29e776-d887-4f33-9188-6af218c6025b\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Ftrevogi-kentavra%2Fthumbnail.webp?alt=media&token=d4cd80c9-f9e6-4289-8965-7f09ca9ce8b9', 'Химена — милая и застенчивая кентаврийка. Ее мир населен сверхъестественными существами, такими же, как и она сама. Все ее одноклассники имеют кто рожки, кто крылья, кто хвост, кто нимб и прочие видимые не менее занимательные части тела. Несмотря на свои различия Химена вместе со своими подружками — Нозоми и Кёко — живёт беззаботной и повседневной школьной жизнью…', '2018-06-11 11:59:09', 1163, 0, 'trevogi-kentavra', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(8, 0, 'Сделанный в Бездне', 'Made in Abyss', 13, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fbezdna%2FKANSAI_Made_in_Abyss_720p_torrent(1).torrent?alt=media&token=4132f2b6-3860-40b5-b111-36e022e15281\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fbezdna%2FKANSAI_Made_in_Abyss_1080p_torrent(1).torrent?alt=media&token=4b9606c7-f105-41d8-ba0b-bb62a2ea57e9\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fsdelannyy-v-bezdne%2Fthumbnail.webp?alt=media&token=c4369e77-af11-4c8d-96e0-98a1ad267c36', 'Огромная пещерная система, известная как Бездна, является последним неисследованным местом в мире. В этой титанической яме обитают странные и удивительные существа. Она полна таинственных древних реликвий, предназначение которых неизвестно современному человеку. Поколения смелых авантюристов были затянуты ее загадочными глубинами. Со временем достаточно храбрые, чтобы исследовать опасную яму, стали известны как «Исследователи Бездны».  В Оос, городе на краю Бездны, живет маленькая сирота по имени Рико, которая мечтает стать великим пещерным налетчиком, каким была ее мать, и разгадать великую тайну расщелины. Однажды, исследуя темные глубины, она натыкается на маленького мальчика, который оказывается роботом...', '2018-06-11 11:59:09', 3930, 0, 'sdelannyy-v-bezdne', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(9, 0, 'Мастера Меча Онлайн: Порядковый Ранг', 'Sword Art Online: Ordinale Scale', 1, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2FSword%20Art%20Online%20-%20Ordinale%20Scale%2F%5BKANSAI%5D_Gekijouban_Sword_Art_Online_Ordinal_Scale_%5B720p%5D.mkv.torrent?alt=media&token=8f9d584f-bcb0-45ca-8f0b-34114ab18af7\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2FSword%20Art%20Online%20-%20Ordinale%20Scale%2F%5BKANSAI%5D_Gekijouban_Sword_Art_Online_Ordinal_Scale_%5B1080p%5D.mkv.torrent?alt=media&token=995c3940-61cf-4632-917b-1dedc1b64278\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fmastera-mecha-onlayn-poryadkovyy-rang%2Fthumbnail.webp?alt=media&token=b011b609-c12b-4f9a-9195-37d78948b4cf', '2026 год, на смену «Амусферы» приходит «Augma» — устройство расширенной реальности, которая вместо функции «полного погружения», использует дополненную реальность, что делает процесс использования устройства безопаснее и удобнее. Благодаря этому оно и получило большую популярность, а вместе с ней пришла и «Ordinal Scale» — ARMMORPG, разработанная специально для «Augma». Все игроки в ней получают ранг, основанный на их порядковом номере. Как и ожидалось, Кирито с друзьями начинают играть в «Ordinal Scale», но вскоре они узнают, что «Порядковый ранг» — это гораздо больше, чем просто игра…', '2018-06-11 11:59:10', 3302, 0, 'mastera-mecha-onlayn-poryadkovyy-rang', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(10, 0, 'Чистюля Аояма-кун', 'Keppeki Danshi! Aoyama-kun', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Faoyama-kun%2F%5BKANSAI%5D_Keppeki_Danshi!_Aoyama-kun_%5B720p%5D.torrent?alt=media&token=8cf8d828-585b-41b4-90eb-bb13bcbb4595\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Faoyama-kun%2F%5BKANSAI%5D_Keppeki_Danshi!_Aoyama-kun_%5B1080p%5D.torrent?alt=media&token=10ece282-606f-4f98-a12d-701d1ceae076\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2Faoyama-kun%2FPLAKAT_AOYAMA.png?alt=media&token=74d06489-2aff-4136-9ace-50203d4e76c8', 'Аояма играет за юношескую сборную Японии по футболу. Его навыки и перспективы просто поражают. Кроме того - он еще и красавчик. Однако без странностей не обошлось. Парень настолько чистюля, что это складывается на стиле игры: он ни при каких обстоятельствах не отбивает мяч головой и не стелется в подкат, а если ему и приходится брать мяч в руки, то для этого он надевает свои белоснежные перчатки. Чего же добьется этот парень?', '2018-06-11 11:59:11', 761, 0, 'chistyulya-aoyama-kun', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
