(19, 0, '18 маленьких \"если\"', '18if', 13, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F18if%2FKANSAI_18if_720p_torrent.torrent?alt=media&token=c76fa803-5bc8-4fa3-9381-c4e5ab9df4d9\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F18if%2FKANSAI_18if_1080p_torrent.torrent?alt=media&token=e3d6db0a-4f40-4d21-86ed-1f467ca7a030\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F18if%2F88916acd9bdc47237c0bfc61541233d81499440691_full.jpg?alt=media&token=6394f03d-23fb-4fe5-bc14-6c297c6b024f', 'Адаптация одноимённой мобильной игры. Данное произведение расскажет нам о Мире Снов — пространстве коллективного бессознательного, наполненном мечтами, желаниями и страхами людей. Всё здесь происходит в фантастических многоуровневых ландшафтах, где оказываются люди, подвергшиеся действию загадочной болезни под названием «Синдром спящей красавицы». Однажды, в этот мир попадает наш главный герой — Харуто Цукиширо. Каждый раз Харуто пытается заснуть, и его сознание невольно проникает внутрь чужих снов. Но, однажды, он оказывается заперт внутри сна ведьмы, желающей сбежать от своей проблемы — от той самой болезни. Неужели, Харуто придётся остаться в её голове навсегда, и сможет ли парень выбраться из мира сна в реальный мир? ', '2018-06-11 11:59:17', 1047, 0, '18-malenkikh-esli', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
