он является хранителем леса. Так Чисэ наконец-то удалось обрести душевный покой, а впереди её ждали необычайные приключения.', '2018-06-11 11:59:23', 877, 0, 'nevesta-charodeya-spetsvypusk', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
