(29, 0, 'Сейлор Мун Кристалл', 'Sailor Moon Crystal', 38, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fseylor-mun-kristall%2Fthumbnail.webp?alt=media&token=555f06bb-50b1-4fdd-abde-f3d69a24d706', 'Давным-давно Солнечной системой правила мудрая и прекрасная Лунная королева Сирэнити, а ее покой охраняли воительницы, владеющие силами планет. Увы, этого не хватило, чтобы остановить врага, явившегося из глубин космоса. Хрустальный Город пал, и в последнем бою королева пожертвовала собой, чтобы погрузить сильнейших противников в сон, а собственную дочь и воинов планет отправить в далекое будущее на перерождение. Сирэнити знала, что с пробуждением «светлых» в мир явятся и «темные», потому смогла послать в грядущее вестников, чтобы те защитили и направили Лунную Принцессу и ее подруг. А дальше наступила Тьма… В 1990-е годы уже иной эры в Токио живет-поживает ученица средней школы Усаги Цукино, обожающая укладывать свои золотые косы в виде булочек-данго. Все началось, когда Усаги нашла говорящую черную кошку с полумесяцем на лбу. Как истинная блондинка, Цукино пропустила ее слова мимо ушей, но стоило подруге попасть в беду – не думая, воспользовалась дотоле спящими силами. Вот так воительница Луны начала борьбу со злом и постепенно собрала свой ближний круг – умницу Ами, красавицу Минако, пламенную Рэй и томбойку Макото. Хотите знать, что дальше – смотрите! Знаете, что будет – тоже смотрите, чтобы еще раз пережить эту чудесную историю! И да поможет нам всем Лунная Призма!', '2018-06-11 11:59:24', 1995, 0, 'seylor-mun-kristall', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(30, 0, 'Путь на Запад: Перезарядка!', 'Saiyuki: Reload Blast', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fsaiyuki-reload-blast%2FKANSAI_Saiyuki_Reload_Blast_720p_torrent.torrent?alt=media&token=d3a3aa31-0a3b-4b71-989d-55e302dec8cb\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fsaiyuki-reload-blast%2FKANSAI_Saiyuki_Reload_Blast_1080p_torrent.torrent?alt=media&token=dd1ec628-a1c7-4282-9d0e-004c6111a88d\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fput-na-zapad-perezaryadka%2Fthumbnail.webp?alt=media&token=dc55a5b0-e620-4b5d-9093-201c6123c6d8', 'Отряд Санзо прибывает в Индию. В этой дикой стране накал и жестокость сражений растут по мере их приближения к цели. Их миссия – предотвратить воскрешение злейшего из демонов Гю-ма-о. Они не герои, их девиз - \"Будь свободен и не позволяй никому привязать себя\". Они не считают себя командой, но никогда не бросят друг друга в беде. Судьба, предначертанная им пять веков тому назад, уже ждет их.', '2018-06-11 11:59:25', 520, 0, 'put-na-zapad-perezaryadka', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(31, 0, 'Демоны старшей школы: Герой', 'High School DxD Hero', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdemony-starshey-shkoly-geroy%2Fthumbnail.webp?alt=media&token=6afba1a3-2537-47f3-8f3f-40c0270545a0', 'Продолжение истории о Иссее Хёдо, школьнике-извращенце, который перевоплотился в демона после того, как Риас Грэмори проткнула ему живот на первом же свидании.\nКак оказалось позже, девушка спасла Иссея, и теперь тот обязан служить своей благодетельнице.\nГерой узнает, что у если он станет знатью среди демонов, то сможет собрать собственный гарем. Ради этого он решает забраться на самый верх социальной лестницы демонов и стать Королём Гарема!\nНо чтобы приспособиться к новой жизнии и выжить в жестоком мире ангелов и демонов, Иссею придётся усердно тренироваться и сражаться.', '2018-06-11 11:59:26', 300, 0, 'demony-starshey-shkoly-geroy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(32, 0, 'Страсти общежития Тачибанакан', 'Tachibanakan To Lie Angle', 9, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fstrasti-obschezhitiya-tachibanakan%2Fthumbnail.webp?alt=media&token=efd0cbd8-a882-4c13-ad80-8620e9c3e8d6', 'Нацуно Ханаби вернулась в свой родной город для обучения в старшей школе. Она думала, что её ждёт чудесная жизнь, но общежитие Тачибанакан оказалось не таким, как она предполагала.', '2018-06-11 11:59:27', 192, 0, 'strasti-obschezhitiya-tachibanakan', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(33, 0, 'Я и 23 раба', 'Dorei-ku The Animation', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fya-i-23-raba%2Fthumbnail.webp?alt=media&token=2ece569f-3644-443e-9c57-a878d1d891b5', 'Представьте, что вы можете поработить кого угодно. Это стало возможно! \nСуществует специальное устройство, позволяющее подчинить себе любого, кто обладает аналогичным девайсом. Но есть одно условие: чтобы сделать человека своим рабом, сперва нужно одержать над ним победу.', '2018-06-11 11:59:28', 1516, 0, 'ya-i-23-raba', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(34, 0, 'Господство пленных богов', 'Hakyuu Houshin Engi', 18, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fgospodstvo-plennykh-bogov%2Fthumbnail.webp?alt=media&token=553a8723-57c2-4104-b8f6-fd4157514521', 'Когда весь его клан вырезает прекрасный демон, юный Тайкобо становится во главе загадочного проекта «Хоушин». Его цель – найти всех бессмертных, находящихся в мире людей и запечатать их навсегда. Но кому же стоит верить и чью сторону принять, если охотиться на демонов тебя учит демон?', '2018-06-11 11:59:28', 1103, 0, 'gospodstvo-plennykh-bogov', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(35, 0, 'Сакура – охотница за картами', 'Cardcaptor Sakura: Clear Card-hen', 18, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fsakura-okhotnitsa-za-kartami%2Fthumbnail.webp?alt=media&token=d3cdae00-2574-432a-bb74-47663319901e', 'Четырнадцатилетняя Сакура переходит в старшую школу вместе со своими друзьями,\nсреди которых и Сяоран, только что вернувшийся в Томоэду. После того, как Сакура\nвидит сон о загадочной фигуре в плаще, все её кары внезапно теряют силу, так что\nтеперь она должна выяснить, что произошло. На пути к разгадке Сакура и её друзья\nнаходят и ловят прозрачные карты, используя новый ключ.', '2018-06-11 11:59:29', 1749, 0, 'sakura-okhotnitsa-za-kartami', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(36, 0, 'Боруто: Следующее поколение Наруто', 'Boruto: Naruto Next Gen!', 59, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fboruto%2F%5BKANSAI%5D_Boruto_-_Naruto_Next_Generations_TV_%5B720p%5D%20(2).torrent?alt=media&token=01f4e2d3-5576-454a-a529-e9227bd78a4b\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2Fboruto%2F%5BKANSAI%5D_Boruto_-_Naruto_Next_Generations_TV_%5B1080p%5D%20(1).torrent?alt=media&token=603438ad-e005-4772-a2ad-9a49bb4879d5\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2Fboruto%2FPLAKAT_BORUTO.png?alt=media&token=be3ebaf0-cabb-441f-afc7-26929020f6ba', 'Наруто Узумаки был юным задиристым шиноби, ходячим магнитом для неприятностей. Но пройдя долгий путь, он достиг того, чего так яростно желал — титула Хокаге, звания сильнейшего ниндзя Деревни Листвы. Однако эта история не о нём. С тех пор прошло много времени, и мир сильно изменился. Вместе с миром и спокойствием в Коноху пришли современные технологии — телевидение, небоскрёбы, кондиционеры, поезда и многое другое. Однако шиноби никуда не делись, и их жизнь также сильно изменилась. Сын седьмого Хокаге— Боруто поступает в академию ниндзя. Он унаследовал от своего отца буйный характер, однако не намерен идти по его стопам. Как ветер, проносящийся между листвы, он прокладывает путь к сердцу каждого человека — его история начинается!', '2018-06-11 11:59:30', 18383, 0, 'boruto-sleduyuschee-pokolenie-naruto', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(37, 0, 'Семь смертных грехов. Возрождение заповедей', 'Nanatsu no Taizai: Imashime no Fukkatsu', 14, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fsem-smertnykh-grekhov-vozrozhdenie-zapovedey%2Fthumbnail.webp?alt=media&token=35ebd2d3-9b00-4c73-9b0b-82278ddf6b20', 'Правителю королевства Лионес приходит страшное видение: древняя тьма вырвется из клетки, принеся хаос и раздор в земли людей. Орден Святорыцарей опорочен и не в силах остановить угрозу. И лишь семеро отступников, чьи имена на слуху у каждого жителя страны, способны противостоять надвигающемуся злу. И имя им - Семь Смертных Грехов!', '2018-06-11 11:59:31', 4513, 0, 'sem-smertnykh-grekhov-vozrozhdenie-zapovedey', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(38, 0, 'Рояль в лесу', 'Piano no Mori', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Froyal-v-lesu%2Fthumbnail.webp?alt=media&token=657c507b-8ba3-4ccd-9cc8-072582ca0bf0', 'Это история о двух мальчиках с совершенно разными судьбами. Один из них - Кай - сын проститутки. С детства он играет на найденном в лесу заброшенном фортепиано.\nВторой -  Шухей, сын знаменитого пианиста, знакомый с фортепиано чуть ли не с пелёнок.\nИ именно благодаря их общему увлечению фортепиано со времени их жизненные пути переплетаются.', '2018-06-11 11:59:31', 118, 0, 'royal-v-lesu', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(39, 0, 'Девушки-пони: Славное дерби', 'Uma Musume: Pretty Derby', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdevushki-poni-slavnoe-derbi%2Fthumbnail.webp?alt=media&token=deed2b2b-2c7c-40a6-b82e-f66ae43b332e', 'Эта история разворачивается в мире, где девушки-лошади с чудесными именами и невероятными способностями живут бок о бок с людьми.', '2018-06-11 11:59:32', 330, 0, 'devushki-poni-slavnoe-derbi', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(40, 0, 'Мёртвый ритм', 'Beatless', 17, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fmertvyy-ritm%2Fthumbnail.webp?alt=media&token=3a9c8864-a9ac-4736-86f6-2ce933d77943', 'Гуманоидные роботы ГИЭ стали настолько популярны, что люди начали полагаться на них во всём, потворствуя своей лени. Возможно, это и стало главной причиной событий этого аниме. 17-летний Арато Эндо однажды повстречал робота Лацию, которая спасла его от несчастного случая. Они решили заключить между собой контракт владения, но Арато не знал, что ему достался очень редкий робот, один из пяти роботов, эволюционировавших и превзошедших человека по уровню развития. Также не знал он, что вскоре будет втянут в конфликт между роботами, имеющими свой смысл жизни и желание забрать друг у друга особые способности. Чем же обернётся эта борьба, и какими станут отношения между людьми и машинами?', '2018-06-11 11:59:33', 3034, 0, 'mertvyy-ritm', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(41, 0, 'Щелкунчик Китаро (2018)', 'Gegege no Kitarou', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fschelkunchik-kitaro-2018%2Fthumbnail.webp?alt=media&token=d5709bd2-58a8-4cc8-9536-5d334d3bad94', 'Внезапно в человеческом мире начинают происходить странные необъяснимые вещи. В поисках ответов тринадцатилетняя девочка Мана решает написать и отправить ёкаям письмо. И к её удивлению, появляется Китаро - последний в своём роду ёкай!', '2018-06-11 11:59:35', 272, 0, 'schelkunchik-kitaro-2018', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]');
