(42, 0, 'Мастера Меча Онлайн Альтернатива: «Призрачная пуля»', 'Sword Art Online Alternative: Gun Gale Online', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fmastera-mecha-onlayn-alternativa-prizrachnaya-pulya%2Fthumbnail.webp?alt=media&token=046ab355-312e-4bc8-80a2-e51313532635', 'Карен Кохируимаки всегда чувствовала себя неловко в реальном мире. Из-за своего чрезвычайно высокого роста (183 см) ей всегда было сложно подружиться с девочками своего возраста. Но все меняется, когда она знакомится с VR и Gun Gale Online. Ведь в GGO Карен может играть аватаром своей мечты - маленьким милым персонажем!\nУдастся ли Карен найти друзей в этом суровом онлайн-шутере? ', '2018-06-11 11:59:36', 1949, 0, 'mastera-mecha-onlayn-alternativa-prizrachnaya-pulya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(43, 0, 'Второй мэйджор', 'Major 2nd', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fvtoroy-meydzhor%2Fthumbnail.webp?alt=media&token=9c4e1d24-d36b-4356-ac38-fadadd2603bb', 'Дайго - сын Горо, великого бейсболиста. Какой же путь ждёт Дайго в бейсболе? Справится ли он с гнётом возложенных на него огромных надежд? Оправдает ли ожидания окружающих?\n', '2018-06-11 11:59:37', 178, 0, 'vtoroy-meydzhor', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(44, 0, 'Сайт волшебниц', 'Mahou Shoujo Site', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fsayt-volshebnits%2Fthumbnail.webp?alt=media&token=e34e4bb5-bb9b-4850-971c-4defd4245e5b', 'У ученицы средней школы Аи Асагири проблемы не только в школе, но и дома: брат применяет к ней физическое насилие. Однажды Ая внезапно натыкается на странный сайт с изображением жуткой девочки. Девочка сообщает Ае, что дарует ей магические силы.', '2018-06-11 11:59:37', 1781, 0, 'sayt-volshebnits', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(45, 0, 'Лострейдж: Объединение «WIXOSS»', 'Lostorage Conflated WIXOSS', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Flostreydzh-obedinenie-wixoss%2Fthumbnail.webp?alt=media&token=d978d397-2423-4a61-83b4-baa791dbbe75', '\"Тьме не будет конца.\"\nНад мирной и беззаботной жизнью вновь нависает тень сражений селекторов. Киёи Мидзусима сразу это замечает и старается всё предотвратить. Вдобавок появляется новая карта - \"Ключ\". Правила до сих пор окутаны загадками, а тьма тем временем всё нарастает. Сузуко Хомура, Чинатсу Морикава, Рууко Коминато, Юзуки Куребаяши, Хитое Уемура и Акира Аой - вот те селекторы, которым предстоит сразиться в финальном битве, где на кон будут поставлены их \"Желания\", \"Воспоминания\" и \"Ключи\"...', '2018-06-11 11:59:38', 144, 0, 'lostreydzh-obedinenie-wixoss', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(46, 0, 'Хинамацури', 'Hinamatsuri', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkhinamatsuri%2Fthumbnail.webp?alt=media&token=34306b16-c0bb-4aa2-9861-11545330cd3b', 'Однажды ночью на голову Нитты, члена клана якудза, падает странный предмет. В нём оказалась девочка Хина. Она обладала сверхъестественной силой, и Нитта с неохотой принял её. Её силы оказались очень полезны в его работе, но сам он тоже рискует стать их жертвой. Так же, если долго не пользоваться силой, Хина теряет над ней контроль и уничтожает всё вокруг.', '2018-06-11 11:59:38', 273, 0, 'khinamatsuri', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(47, 0, 'Чайная \"Рокуходо\"', 'Rokuhoudou Yotsuiro Biyori', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fchaynaya-rokukhodo%2Fthumbnail.webp?alt=media&token=bf6ceb11-ae53-4b9d-ab83-7dccaf11df09', 'Гуре, Суи, Токитака и Цубаки вместе заведуют японским чайным магазинчиком под названием \"Рокуходо\". Каждому посетителю здесь оказывают тёплый приём, предлагают чашечку чая и даже помогают с решением жизненных проблем.', '2018-06-11 11:59:39', 276, 0, 'chaynaya-rokukhodo', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(48, 0, 'Небесная машина Пандора', 'Juushinki Pandora', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fnebesnaya-mashina-pandora%2Fthumbnail.webp?alt=media&token=1483eb8f-bca6-4fbe-ad0b-d881ca58da8b', 'В мире ближайшего будущего разница между человеком и искусственным интеллектом становится всё менее заметна. Один инцидент послужил толчком к быстрой биологической эволюции, благодаря чему она вышла за биологические рамки и затронула многие материалы и технологии. Наступает эра массовой эволюции, в которой развиваются люди, машины и биотехнологии.', '2018-06-11 11:59:40', 253, 0, 'nebesnaya-mashina-pandora', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(49, 0, 'Весы Нила Адмирари: Загадочная история Тэйто', 'Nil Admirari no Tenbin: Teito Genwaku Kitan', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fvesy-nila-admirari-zagadochnaya-istoriya-teyto%2Fthumbnail.webp?alt=media&token=009ca782-fa39-428c-97c1-b51ab6c6581e', 'История разворачивается в вымышленном мире, где эпоха Тайсё длилась не 15 лет, а 25. Ради спасения своей семьи девушка решается выйти замуж за человека, даже не зная его имени. Однако прямо перед самой свадьбой младший брат девушки при загадочных обстоятельствах совершает самоубийство путём самосожжения. В его руках находят старую книгу.\nОшеломлённая девушка узнаёт, что оказывается существуют книги, которые называются \"маремоно\". Они оказывают на читателя очень сильное влияние.\nКо всему прочему после трагической кончины брата девушка обретает способность видеть \"ауры\" маремоно. Будто бы сама судьба играет с героиней злую шутку.\nНо несмотря на страх, девушка решает рискнуть. Ревность, ненависть, презрение, сострадание и любовь. А ещё её ждет тьма предательства, которая уже нависает над имперской столицей.\nСкитаясь в этой тьме, сможет ли девушка наконец достичь истины?..', '2018-06-11 11:59:40', 238, 0, 'vesy-nila-admirari-zagadochnaya-istoriya-teyto', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(50, 0, 'Хладнокровный Хозуки 2 сезон: часть вторая', 'Hoozuki no Reitetsu 2nd Season: Sono Ni', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fkhladnokrovnyy-khozuki-2-sezon-chast-vtoraya%2Fthumbnail.webp?alt=media&token=59e2f5de-7189-47d4-a1e5-600a158293c6', 'Чёрная комедия о жизни помощника короля преисподней Энмы - Хозуки. Ему приходится решать разные возникающие в аду проблемы, с чем он, хладнокровный и циничный, успешно справляется.', '2018-06-11 11:59:41', 129, 0, 'khladnokrovnyy-khozuki-2-sezon-chast-vtoraya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(51, 0, 'Хисонэ и Масо', 'Hisone to Maso-tan', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkhisone-i-maso%2Fthumbnail.webp?alt=media&token=7eee1711-16bc-433f-a49c-15aec0474ed6', 'Прямолинейная и простая Хисонэ Амакасу вступает в ВВС базы Гифу. Она решается на это, чтобы дистанцироваться от людей, потому что переживает из-за того, что её откровенные слова часто задевают окружающих.\nЭто решение привело её к судьбоносной встрече с драконом, которая  в корне изменила её жизнь.', '2018-06-11 11:59:43', 191, 0, 'khisone-i-maso', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(52, 0, 'Легенда о героях галактики', 'Ginga Eiyuu Densetsu: Die Neue These - Kaikou', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Flegenda-o-geroyakh-galaktiki%2Fthumbnail.webp?alt=media&token=93a37013-20ff-4a4c-9b9e-a0c13c2fc0ab', 'В далёком будущем монархическая Галактическая Империя и демократический Альянс Свободных Планет ведут нескончаемую войну. \nЭта история расскажет нам о похождениях двух людей из враждующих держав - Рейнхарда фон Мюселя, стремящегося к власти в Галактической Империи, и Янга Вэн-Ли, военнослужащего и учёного Альянса Свободных Планет', '2018-06-11 11:59:44', 780, 0, 'legenda-o-geroyakh-galaktiki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(53, 0, 'Аманчу! Вперёд', 'Amanchu! Advance', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Famanchu-vpered%2Fthumbnail.webp?alt=media&token=e76098fd-a1aa-4c2e-b31f-2c5d0ffb81e3', 'Хикари Кохината - пятнадцатилетняя дружелюбная девушка, живущая в прибрежном городке на полуострове Изу. Вместе с Ооки Футабой, девушкой из Токио, она во всю наслаждается подводным плаванием.', '2018-06-11 11:59:44', 134, 0, 'amanchu-vpered', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(54, 0, 'АК-кун и его девушка', 'Akkun to Kanojo', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fak-kun-i-ego-devushka%2Fthumbnail.webp?alt=media&token=d14d13ee-1d75-449f-881d-889546ebb60a', 'Романтическая комедия о повседневной жизни Ацухиро Кагари, грубого, но в тайне безумно любящего свою девушку Нон Катагири. При ней он безразличен и резок, но сам скрытно наблюдает за ней и подслушивает. Нон не знает об этой слежке и считает его очень милым.', '2018-06-11 11:59:45', 154, 0, 'ak-kun-i-ego-devushka', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(55, 0, 'Жрицы с мечами', 'Toji no Miko', 17, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fzhritsy-s-mechami%2Fthumbnail.webp?alt=media&token=6190278a-0b04-4e80-b477-3c041d2689df', 'С древних времён жрицы при храмах носили с собой мечи для того, чтобы с их помощью изгонять «аратама» - неведомых существ, угрожающих миру людей. Сейчас в Японии существует пять специальных школ, в которых воспитываются новые поколения жриц, именуемых Мечницами. С виду это обычные школьницы, но внутри они бесстрашные воительницы, всегда готовые дать отпор злу. Но, кто из них сильнейшая в своем поколении? Это станет ясно на ежевесеннем Турнире Мечниц! ', '2018-06-11 11:59:46', 1471, 0, 'zhritsy-s-mechami', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(56, 0, 'Василиск: книга ниндзя в вишнёвом цвету', 'Basilisk: Ouka Ninpouchou', 19, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fvasilisk-kniga-nindzya-v-vishnevom-tsvetu%2Fthumbnail.webp?alt=media&token=c004565e-4878-42fb-b2fa-28f9415a4b03', 'Снова в центре внимания истории кланы Ига и Кога. Во главе клана Кога стоит Хачиро, мудрый и очень талантливый парень, который унаследовал свой особенный дар от отца. Главой клана Ига является Хибики, изящная и невинная девушка, впитавшая с молоком матери и её техники ниндзя. У них разные фамилии, разные кланы, но одна кровь. Они брат и сестра. Но какое будущее ждёт их? Будут ли они воевать, как их предки, или же откроют новую эру мира? Решение остаётся за ними.', '2018-06-11 11:59:47', 1410, 0, 'vasilisk-kniga-nindzya-v-vishnevom-tsvetu', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(57, 0, 'Колония (Третий сезон)', 'Colony', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B8%D1%8E%D0%BD%D1%8C%2Fkoloniya-tretiy-sezon%2Fthumbnail.webp?alt=media&token=89164cf4-f1d5-4fe6-aa94-532cbeed3b2a', 'В ближайшем будущем семья пытается спасти жителей оккупированного Лос-Анджелеса. Бывший агент ФБР Уилл Боумэн и его супруга Кейти пробуют вернуть сына.\n\nУилл готов работать на новое правительство, тогда как многие в городе поддерживают повстанцев. Лидер режима Прокси Снайдер предлагает Уиллу сделку, которая изменит их жизнь и заставит семью пойти на большой риск.', '2018-06-11 11:59:47', 31, 0, 'koloniya-tretiy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(58, 0, 'Сотня (Пятый сезон)', 'The 100', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fsotnya-pyatyy-sezon%2Fthumbnail.webp?alt=media&token=8dc90859-1620-47a5-b4ef-7c177478f5c1', 'События в сериале начинают разворачиваться по прошествии девяносто семи лет после того, как всю цивилизацию уничтожила страшная атомная война.\n\nВысоко в космосе на орбите Земли летает большой космический корабль, где находятся те, кто выжил после страшной катастрофы. Именно с этого последнего пристанища людей на Землю отправляют космический челнок, на котором находятся сто малолетних преступников…', '2018-06-11 11:59:48', 1940, 0, 'sotnya-pyatyy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(59, 0, 'Линия дьявола', 'Devils Line', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fliniya-dyavola%2Fthumbnail.webp?alt=media&token=f48cc8b7-7654-4ee4-8105-bd34b4f87252', 'Герои истории - полу-вампир Анзай и обычная школьница Цукаса.\nВампиры живут среди людей. Правительство не подозревает о их существовании, потому что внешне они не отличаются от людей. К тому же, они научились подавлять жажду крови.\nНо когда желание испить человеческой крови всё же берёт верх, вампир может превратиться в неуправляемого монстра.', '2018-06-11 11:59:49', 578, 0, 'liniya-dyavola', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(60, 0, 'Ниндзя Нобунаги: Анегава Ишияма', 'Nobunaga no Shinobi: Anegawa Ishiyama-hen', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fnindzya-nobunagi-anegava-ishiyama%2Fthumbnail.webp?alt=media&token=528bc9c1-9e2e-4532-80cb-e956916eecfa', 'Перед нами предстаёт историческая Битва при Анегаве, в которой силы Оды Нобунаги и Токугавы Иэясу противостоят силам Азаи и Асакуры.', '2018-06-11 11:59:49', 94, 0, 'nindzya-nobunagi-anegava-ishiyama', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(61, 0, 'Детективное агентство Лейтон: Расследования Кэт', 'Layton Mystery Tanteisha: Katri no Nazotoki File', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdetektivnoe-agentstvo-leyton-rassledovaniya-ket%2Fthumbnail.webp?alt=media&token=5906511d-be51-4daa-a609-c57da1e6ad19', 'Место действия - Лондон. Катриэль раскрывает таинственные дела вместе со своей говорящей собакой Шерл.', '2018-06-11 11:59:50', 188, 0, 'detektivnoe-agentstvo-leyton-rassledovaniya-ket', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(62, 0, 'Кулак Синего неба: Перерождение', 'Souten no Ken Re:Genesis', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkulak-sinego-neba-pererozhdenie%2Fthumbnail.webp?alt=media&token=e5463c03-4aef-462c-8031-4503df6f73c5', 'Кенширо Касуми - 62й мастер Хокуто Шинкен \"Божественный кулак Северной Звезды\". Он - сильнейший и самый жестокий мастер Хокуто за всю его 1800летнюю историю.', '2018-06-11 11:59:51', 1751, 0, 'kulak-sinego-neba-pererozhdenie', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(63, 0, 'Семейка Франкенштейн', 'Jikken-hin Kazoku', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fsemeyka-frankenshteyn%2Fthumbnail.webp?alt=media&token=f713f11f-177f-4283-986f-58e014cfcdcc', 'Оба родителя в этой семье - безумные учёные. Практически все их дети подверглись генетическим экспериментам. Именно поэтому один из их сыновей - оборотень, а у дочери из-за спины торчат паучьи лапы. Участь быть генетически модифицированным обошла стороной только младшего сына этой семьи.\nНо чтобы не привлекать к себе лишнего внимания и сохранить эксперименты в тайне, все члены семьи стараются вести себя как самые обыкновенные люди. ', '2018-06-11 11:59:52', 1497, 0, 'semeyka-frankenshteyn', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(64, 0, 'Танцы с драконами', 'Saredo Tsumibito wa Ryuu to Odoru', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Ftantsy-s-drakonami%2Fthumbnail.webp?alt=media&token=6d9d5e9f-01f2-4600-9ec6-7ff91b42a2d5', 'Действие происходит в альтернативном мире. Основные события разворачиваются в городе Эридан. Одна половина этого города находится в драконьей империи Цеберун, а другая расположена на территории альянса семи городов Лапетод. Эти две части Эридана отделены друг от друга рекой Ориэлаль.\nВ этом мире существуют особые силы, которые называются \"джушики\". По сути это химические реакции, которые при использовании специального оружия создают эффект, как от магического заклинания. Такое оружие называется \"магических посохом\". Как и обычное оружие, магические посохи бывают разнообразных видов.\nДжушики используются для борьбы с мерзкими существами которые от природы могут пользоваться этой силой, из-за чего представляют угрозу для людей.\nВ центре сюжета - Жижина Эшли Боеф и Левина Сорел Гаюс - единственные сотрудники агентства \"Эшли-Боеф и Сорел Компани\". Им поступают самые разные заказы, для выполнения которых требуется искусное владение джушики.', '2018-06-11 11:59:52', 305, 0, 'tantsy-s-drakonami', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(65, 0, 'Последний период: История бесконечной спирали', 'Last Period: Owarinaki Rasen no Monogatari', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fposledniy-period-istoriya-beskonechnoy-spirali%2Fthumbnail.webp?alt=media&token=59408b60-ea20-4c56-92a3-c92abc8acc4f', '\"\"Спиралями\"\" называют призванных извне чудовищ, а \"\"периодами\"\" - тех, кто с ними сражается. Главный герой - четырнадцатилетний Хару, начинающий период. \nОднажды происходит загадочная кража, которая приводит к экономическим проблемам. В результате главный офис бросает подразделение,  в котором числится Хару, на произвол судьбы. В нём остаётся лишь три периода, включая Хару.\nРебятам предстоит проделать большую работу, чтобы восстановить своё Восьмое Подразделение.', '2018-06-11 11:59:53', 117, 0, 'posledniy-period-istoriya-beskonechnoy-spirali', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(66, 0, 'На железнодорожном переезде', 'Fumikiri Jikan', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fna-zheleznodorozhnom-pereezde%2Fthumbnail.webp?alt=media&token=af45bfc8-2f9f-438a-8a05-66adb47790ca', 'Вся наша жизнь состоит из сплошной суеты. Люди всё время куда-то спешат, торопятся, бегут… В головокружительной будничной суете нам порой некогда даже перевести дух. Но во всём должен существовать баланс. И если мы не можем сами вовремя остановиться, то город сделает это за нас. На то существуют светофоры, на которых можно затормозить и провести минутку в простом ожидании. А есть и железнодорожные переезды, где придётся постоять подольше, вглядываясь вдаль и выискивая силуэт приближающегося поезда, а также посчитать, сколько же у него вагонов.\n\nЭта история коротких рассказов повествует нам, о повседневной жизни и разговорах молодых девушек на различные темы, ожидающих на железнодорожных перекрёстках.', '2018-06-11 11:59:53', 184, 0, 'na-zheleznodorozhnom-pereezde', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(67, 0, 'Вселенная милашки Хани', 'Cutie Honey Universe', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fvselennaya-milashki-khani%2Fthumbnail.webp?alt=media&token=c02bb52c-13ae-4323-a41f-75f682504d9f', 'Хани - андроид, созданный профессором Кисараги. Она обладает уникальным устройством, позволяющим создавать из воздуха что угодно. Злодейская организация Коготь Пантеры желает им завладеть, и в попытке заполучить желанное устройство члены этой организации убивают профессора Кисараги. Разъярённая Хани поклялась уничтожить Коготь Пантеры и отомстить за смерть профессора.\n', '2018-06-11 11:59:54', 242, 0, 'vselennaya-milashki-khani', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(68, 0, 'Капитан Цубаса', 'Captain Tsubasa', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkapitan-tsubasa%2Fthumbnail.webp?alt=media&token=4ce474eb-6374-4794-aad6-b93e9a45b3c0', 'Это история об ученике начальной школы, чуть ли не все мысли которого заняты футболом. Одиннадцатилетний Цубаса Оозора играет в него с малых лет. И если для его друзей это просто игра, для Цубасы футол стал настоящей страстью.\nЧтобы осуществить свою мечту, Цубаса вместе с матерью переезжает в город Нанкацу, который славится своими отличными футбольным командами. В своём городе Цубаса был лучшим, но в Нанкацу конкуренция намного выше, поэтому мальчику придётся приложить все усилия, чтобы достигнуть своей цели!', '2018-06-11 11:59:55', 149, 0, 'kapitan-tsubasa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(69, 0, 'Девушки-мангаки', 'Comic Girls', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdevushki-mangaki%2Fthumbnail.webp?alt=media&token=4e5a964b-7b77-4fd4-b8c6-c51206e60b9f', 'Мота Каоруко (литературный псевдоним - Каос) - пятнадцатилетняя ученица старшей школы, которая рисует ёнкомы. Но опрос читателей манги показал, что рейтинг работ Каоруко находится на самом дне. Поэтому редактор предлагает ей переехать в общежитие для девушек-мангак. Там Каоруко знакомится с работающей в жанре сёдзе Коюмэ, автором подростковой романтики Руки и сёнен-мангакой Тсубасой.  День за днём они будут не покладая рук трудиться над созданием манги.\nВесёлая жизнь Каоруки в общежитии для мангак начинается!', '2018-06-11 11:59:55', 165, 0, 'devushki-mangaki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(70, 0, 'Калигула', 'Caligula', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkaligula%2Fthumbnail.webp?alt=media&token=e8ddd6ec-9e43-432b-a023-23ff050a9ba8', 'Мобиус - идеальный цифровой мир, созданный Мю (μ) - виртуальным идолом, которой удалось обрести собственное сознание. Своими песнями она заманивает в Мобиус людей, которые страдают в реальной жизни.\nДля людей, попавших в этот мир, перестаёт существовать реальность. Все они, вне зависимости от пола и возраста, превращаются в школьников, после чего им предстоит снова и снова проживать школьную жизнь. Ведь школьные годы, как считает Мю, это самое светлое время в жизни человека.', '2018-06-11 11:59:56', 352, 0, 'kaligula', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(71, 0, 'Новенькая (седьмой сезон)', 'New Girl', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fnovenkaya-sedmoy-sezon%2Fthumbnail.webp?alt=media&token=392ebbed-a77d-4c82-9b28-3365f63fc920', 'Комедия о сексуальных отношениях мужчин и женщин. В центре сюжета — Джессика, оптимистичная, но несчастная в любви учительница начальной школы, которая после последнего разрыва въезжает в квартиру, где уже живут три парня.', '2018-06-11 11:59:57', 514, 0, 'novenkaya-sedmoy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(72, 0, 'База Куантико (Третий сезон)', 'Quantico', 2, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B8%D1%8E%D0%BD%D1%8C%2Fbaza-kuantiko-tretiy-sezon%2Fthumbnail.webp?alt=media&token=2b2b2191-0a83-4dcd-b484-697a712ebfe9', 'Шесть совершенно разных новобранцев поступают на стажировку в ФБР на базу Куантико в штате Вирджиния. Базой руководит Миранда Шоу, первая женщина на высшей должности в ФБР. Миранда объединяется со своим бывшим партнером, Лиамом О`Коннором, который ныне работает советником, чтобы отобрать лучших новобранцев в агенты. Тем не менее в будущем один из новобранцев будет подозреваемым в планировании крупнейшего с 11 сентября террористического акта по Нью-Йорку.', '2018-06-11 11:59:58', 27, 0, 'baza-kuantiko-tretiy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(73, 0, 'Брокмайр (Второй сезон)', 'Brockmire', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fbrokmayr-vtoroy-sezon%2Fthumbnail.webp?alt=media&token=422328ca-be6b-4906-ab9d-98d7d17d35d9', 'Джим Брокмайр — знаменитый комментатор игр Главной бейсбольной лиги. Узнав об изменах жены, он послал к чертям профессионализм и слетел с катушек в прямом эфире. Ролик с буйствующим Брокмайром попал в сеть, превратив бывшую звезду во всеобщее посмешище. \n\nДесять лет спустя главный герой предпринимает попытку восстановить свою карьеру и наладить личную жизнь. Начинает Джим с малого — устраивается комментатором игр низшей бейсбольной лиги в крохотном Морристауне.', '2018-06-11 11:59:58', 56, 0, 'brokmayr-vtoroy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(74, 0, 'Элементарно (Шестой сезон)', 'Elementary', 2, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Felementarno-shestoy-sezon%2Fthumbnail.webp?alt=media&token=73ccaa35-6691-4c20-9eb6-b3502e0b32d7', 'Британский сыщик Шерлок Холмс — бывший наркоман, который был отправлен в Нью-Йорк на лечение в реабилитационный центр, а по завершении лечения остался в Бруклине как консультант нью-йоркской полиции. В расследованиях ему помогает его компаньон-наблюдатель доктор Джоан Ватсон, нанятая его отцом.', '2018-06-11 11:59:59', 94, 0, 'elementarno-shestoy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(75, 0, 'Босх (Четвёртый сезон)', 'Bosch', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fboskh-chetvertyy-sezon%2Fthumbnail.webp?alt=media&token=7188e332-0cdf-4902-82e3-871a3fe55aa8', 'Сериал повествует о Гарри Босхе, детективе убойного отдела, который трудится во славу полиции Лос-Анджелеса. Босх расследует дело всей своей жизни, которое случается у каждого копа и донимает его до потери сознания. Речь идет о загадочном убийстве 13-летнего мальчика.', '2018-06-11 11:59:59', 81, 0, 'boskh-chetvertyy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(76, 0, 'Возлюбленный во «ФранКс»', 'Darling in the FranXX', 18, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fvozlyublennyy-vo-franks%2Fthumbnail.webp?alt=media&token=f6ba4053-dcee-414e-b823-0c651b8b302f', 'Под стеклянным куполом, ограждающим небо, дрейфует город-крепость под названием \"Плантация”. Там воспитываются юные пилоты роботов ФранКс, причём им внушается, что пилотировать - это их единственное предназначение. Хиро, пилот под номером Ноль-Шестнадцать, не был допущен и уж хотел ставить на себе крест, но тут судьба преподносит ему неожиданный подарок: таинственную девушку по имени Ноль-Два, что сообщает ему странную новость: \"Я нашла тебя, мой возлюбленный\".', '2018-06-11 12:00:00', 10276, 0, 'vozlyublennyy-vo-franks', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(77, 0, 'Токийский гуль: Перерождение', 'Tokyo Ghoul:re', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Ftokiyskiy-gul-pererozhdenie%2Fthumbnail.webp?alt=media&token=201e8317-309d-487d-a15a-758d6048be94', 'Прошло два года после рейда CCG на Антейку. Обстановка в Токио сильно изменилась из-за возросшего влияния CCG. Гули всё так же вызывают у людей проблемы, просто они стали проявлять большую осторожность. Особую опасность представляет организация Древо Аогири, которая осознаёт растущую для них угрозу со стороны CCG.\n\nДля борьбы с гулями CCQ создаёт специальный отряд куинксов, который состоит из людей, прошедших через операцию по вживлению какухо. Возглавляет этот отряд полу-гуль, полу-человек Сасаки Хайсэ - ученик великого следователя Аримы Кишо.', '2018-06-11 12:00:01', 1207, 0, 'tokiyskiy-gul-pererozhdenie', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(78, 0, 'Реальная девушка', '3D Kanojo: Real Girl', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Frealnaya-devushka%2Fthumbnail.webp?alt=media&token=be40c5cd-2151-4ccd-90df-5edb5dde73a7', 'Цуцуи Хикари - избегающий социальной жизни отаку. В школе у Хикари есть только один друг - изгой, над которым издеваются одноклассники.\n Однажды Хикари пришлось мыть школьный бассейн вместе с Игараши Ирохой, которая смогла собрать в себе всё то, что он ненавидит в настоящих девушках. Она прогульщица, не имеет подруг, и к тому же у неё дурные манеры. Однако Ироха довольно дружелюбна с Хикари, и даже заступается за него, когда над ним издеваются. Из-за собственной озлобленности и недоверчивости Хикари грубит Ирохе, но девушка всё равно не испытывает к нему отвращения. Со временем начинает казаться, что Ироха может стать его первой настоящей 3D-девушкой! Что же будет делать Хикари?', '2018-06-11 12:00:01', 346, 0, 'realnaya-devushka', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(79, 0, 'Человек-дьявол. Плакса', 'DEVILMAN crybaby', 3, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fchelovek-dyavol-plaksa%2Fthumbnail.webp?alt=media&token=f5d2a855-3787-42ea-89eb-f61d53591b1f', 'Жил да был ничем не примечательный парень по имени Акира Фудо. Тот ещё плакса, как говорят про него одноклассники. У него есть лучший друг по имени Рё Асука, который сообщает ему, что вскоре демоны восстанут и истребят человечество. Люди слабы, и, естественно, у них нет шансов против существ, обладающих сверхъестественными силами. Ради выживания Рё предлагает Акире слиться с демоном. И Акира становится Человеком-дьяволом, обладающим могуществом демона, но не утратившим человеческого сердца.', '2018-06-11 12:00:02', 2656, 0, 'chelovek-dyavol-plaksa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(80, 0, 'Бейблэйд: Взрыв - Превосходство', 'Beyblade Burst Chouzetsu', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fbeybleyd-vzryv-prevoskhodstvo%2Fthumbnail.webp?alt=media&token=19ed9286-ace7-4705-b693-ed75246c27ae', 'Аой Волт - импульсивный парень, обладатель бейблэйда Валькирия. У него есть близкий друг - Шу Куренай, гений и элитный блэйдер, владелец бейблэйда Спригган. Аой и его друзья сражаются в турнире за звание блэйдера номер 1 в мире.', '2018-06-11 12:00:03', 61, 0, 'beybleyd-vzryv-prevoskhodstvo', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(81, 0, 'Ученица младших классов — хозяйка гостиницы!', 'Wakaokami wa Shougakusei!', 3, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fuchenitsa-mladshikh-klassov-khozyayka-gostinitsy%2Fthumbnail.webp?alt=media&token=75c3a4e0-7b54-4810-9f52-b08c6d2c0388', 'Двенадцатилетняя Орико Секи потеряла родителей в автокатастрофе, и поэтому живёт с бабушкой в рёкане - традиционной японской гостинице. Ей нужно научиться вести себя как настоящая хозяйка, а это требует тренировок. Хоть поначалу Орико и не нравилось постигать тонкости дела управляющей, со временем она начинает испытывать восхищение к этой работе.\nИтак, путь молодого воина Орико начинается!', '2018-06-11 12:00:04', 84, 0, 'uchenitsa-mladshikh-klassov-khozyayka-gostinitsy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
