(83, 0, 'Денежное поле', 'Gurazeni', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdenezhnoe-pole%2Fthumbnail.webp?alt=media&token=06e46222-41c8-455d-8836-c27430bf1d3d', 'Это история о Натсуноске Бонде - профессиональном бейсбольном релиф-питчере, который вот уже 8 лет играет в команде \"Спайдерс дзингу\". В команде установлено чёткое правило: зарплата каждого игрока зависит от его выступления. Нацуносуке является одним из самых высокооплачиваемых игроков. Он хочет оказаться на самой вершине и всегда оставаться там.\nПоэтому он постоянно ищет новых соперников, которым можно бросить вызов, чтобы доказать, что он - лучший из лучших.', '2018-06-11 12:00:05', 159, 0, 'denezhnoe-pole', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
