(86, 0, 'Пространство (Третий сезон)', 'The Expanse', 2, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fprostranstvo-tretiy-sezon%2Fthumbnail.webp?alt=media&token=108d379c-fd4d-42fa-bb60-ed77091e1081', 'Через двести лет от дня сегодняшнего некий сыщик, привыкший всё доводить до конца при любых обстоятельствах, в рамках расследования дела об исчезновении молодой женщины оказывается на борту звездолета, капитан которого решает помочь детективу в его непростом деле. Величайший заговор в истории человечества гарантируется, как и его непременное раскрытие.', '2018-06-11 12:00:07', 287, 0, 'prostranstvo-tretiy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(87, 0, 'Друзья Айкацу!', 'Aikatsu Friends!', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fdruzya-aykatsu%2Fthumbnail.webp?alt=media&token=3756a077-87dd-4b13-9451-80e788e80fe4', 'Айнэ Юки поступает в Академию Звёздной гармонии, где знакомится Мио Минато, одной из лучших идолов учебного заведения, и решает выступать вместе с ней на сцене. Они с Мио объединяются в дуэт, которому дали название \"Друзья\", и ставят перед собой цель стать одним из величайших идол-дуэтов.', '2018-06-11 12:00:08', 120, 0, 'druzya-aykatsu', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(88, 0, 'Черный Клевер', 'Black Clover', 32, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2002%20Black%20Clover%2FPLAKAT%20Black%20Clover.jpg?alt=media&token=04aca70a-6083-491d-8015-efab0575087e', 'Астер и Юно - сироты, друзья и соперники. Они оба хотят стать Королём Магов - сильнейшим рыцарем-магом Королевства Клевера. Но на пути Астера одно препятствие - он не может колдовать. Что он противопоставит Юно, превосходящему магической силой большинство ровестников? И есть ли шанс у мальчика исполнить свою клятву?', '2018-06-11 12:00:09', 7366, 0, 'chernyy-klever', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(89, 0, 'Моб Психо 100: Рэйгэн — Чудо-экстрасенс, которого никто не знает', 'Mob Psycho 100 Reigen: Shirarezaru Kiseki no Reinouryokusha', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fmob-psikho-100-reygen-chudo-ekstrasens-kotorogo-nikto-ne-znaet%2Fthumbnail.webp?alt=media&token=1241b213-8965-4a6a-aefa-95196e991fed', 'Пересказ событий сериала с комментариями Рэйгена Аратаки.', '2018-06-11 12:00:09', 366, 0, 'mob-psikho-100-reygen-chudo-ekstrasens-kotorogo-nikto-ne-znaet', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(90, 0, 'Так сложно любить отаку', 'Wotaku ni Koi wa Muzukashii', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Ftak-slozhno-lyubit-otaku%2Fthumbnail.webp?alt=media&token=3cbeb732-acda-49ba-ad0a-468502df4784', 'Не видевшие друг друга со времён средней школы Наруми Момосэ и Хиротака Нифуджи вдруг узнают, что работают в одной компании. И вот, после застолья в конце рабочего дня они начинают встречаться. Но чем обернутся отношения яойщицы и заядлого геймера-отаку?', '2018-06-11 12:00:10', 446, 0, 'tak-slozhno-lyubit-otaku', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(91, 0, 'Врата Штейна 0', 'Steins;Gate 0', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fvrata-shteyna-0%2Fthumbnail.webp?alt=media&token=407f42b6-502c-45e6-8ba6-4b5ef368fade', 'Действие берет начало в ноябре 2010 года и разворачивается в поле аттрактора β.\nВпавший в отчаяние Ринтаро Окабэ изо всех сил пытается оправиться от последней неудачной попытки изменить будущее. Стремясь забыть все то, что он пережил в прошлом, и избавиться от терзающих его сознание болезненных воспоминаний, он решает забросить свое второе «я» в лице безумного ученого и начать жить как подобает обычному студенту. Как только, казалось бы, жизнь начинает налаживаться, он внезапно встречает Махо Хиядзё, знакомую Курису Макисэ из американского университета. Махо рассказывает Ринтаро, что в их лаборатории уже начали тестирование нового изобретения, которое предоставляет возможность хранить память человека и способно воссоздать его личностные качества со всеми особенностями характера внутри себя. Приобретение возможности симулировать с помощью этого устройства память Курису приносит в жизнь Окабэ новый переполох, как будто бы возвращая его в пугающее прошлое. Он даже подумать не мог, что это принесет столько мучений и новых неожиданных последствий в предстоящие времена.', '2018-06-11 12:00:11', 1568, 0, 'vrata-shteyna-0', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(92, 0, 'Космический Линкор Тирамису', 'Uchuu Senkan Tiramisù', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fkosmicheskiy-linkor-tiramisu%2Fthumbnail.webp?alt=media&token=8a32d4e7-66ca-407e-9447-f242421decc7', 'Человечество со своей жадностью всё-таки вышло в космос. В 0156 году Космической Эры вспыхивает война между колониями. Земля тайно ведёт строительство нового космического линкора под названием \"Тирамису\". Когда развязывается война, гениальный пилот Ичиносэ Субару берёт на себя управление этим маяком надежды человечества.', '2018-06-11 12:00:12', 197, 0, 'kosmicheskiy-linkor-tiramisu', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(93, 0, 'Тада не может влюбиться', 'Tada-kun wa Koi wo Shinai', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Ftada-ne-mozhet-vlyubitsya%2Fthumbnail.webp?alt=media&token=80439e62-d939-438c-91c3-4682dceb0bc0', 'Мицуёши Тада - мальчик, который никогда не знал любви. Однажды он фотографировал цветущую сакуру и встретил Терезу Вагнер, студентку-переводчицу из Люксембурга. По прибытии в Японию она отделилась от своего попутчика и заблудилась. Мицуёши помогает ей и приводит её в кафе своего дедушки.\n', '2018-06-11 12:00:12', 260, 0, 'tada-ne-mozhet-vlyubitsya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(94, 0, ' Я парень-волшебница', 'Mahou Shoujo Ore', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2F-ya-paren-volshebnitsa%2Fthumbnail.webp?alt=media&token=1ff7c45f-78b8-4a2e-8f52-91404aac5254', 'Это история о 15-летней девочке Уно Саки, мечтающей стать айдолом, которая влюблена в Мохиро, брата своей лучшей подруги Сакуё. Но судьба сталкивает её со страшным якудза. Вместе с её мамой, они рассказывают ей, что когда-то её мама была девочкой-волшебницей, а якудза - был её талисманом. Но злые демоны похищают парня её мечты и жаждут забрать в свой мир. Желая спасти его, она соглашается стать новой девочкой-волшебницей. Но вот только после превращения она становится…парнем, на которого западает её любимый – Мохиро. В попытке спасти парня-волшебницу, её подруга Сакуё тоже превращается в парня. Тогда у их менеджера назревает свой план действий: сделать из них новых звёзд.', '2018-06-11 12:00:13', 322, 0, '-ya-paren-volshebnitsa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(95, 0, 'Кулинарная битва Сомы (3 сезон)', 'Shokugeki no Souma TV3', 17, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2003%20Shokugeki%20no%20Souma%2F%5BKANSAI%5D_Shokugeki_no_Soma_TV3_%5B720p%5D.torrent?alt=media&token=f3757455-ab43-4a40-956a-e2cccaa7dc11\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2003%20Shokugeki%20no%20Souma%2F%5BKANSAI%5D_Shokugeki_no_Soma_TV3_%5B1080p%5D.torrent?alt=media&token=65a5942a-4710-4e36-8035-e791074d88b0\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2003%20Shokugeki%20no%20Souma%2Fae633cc77af697dbc790fc583da42be7.jpg?alt=media&token=5d13fff4-37d1-497b-a307-3b76e18981ed', 'История становления кулинарного гения Сомы продолжается! Герою предстоит покорить новую высоту на своём пути - снискать своим мастерством расположение Элитной Десятки. В новом, уже третьем сезоне, мы снова погрузимся в полный вкусов, ароматов и нешуточной борьбы поварской мир и в который раз убедимся: кухня - это настоящее поле боя!', '2018-06-11 12:00:14', 1630, 0, 'kulinarnaya-bitva-somy-3-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(96, 0, 'Вида', 'Vida', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fvida%2Fthumbnail.webp?alt=media&token=7bb9d12a-9b1d-4364-bbb0-95baab38cf03', 'Эмма и Лин - главные героини этого сериала. Они живут в Соединенных Штатах Америки, но родом из Мексики. Небольшой район города Ангелов Истсайд стал для них родным. Девушки все время проводят в этих окрестностях, пытаясь наладить личную жизнь и профессиональные дела. Неожиданные драматические события, связанные с их прошлым и семьей, заставляют главных героинь иначе взглянуть на реальность. Как оказалось, их мать хранит множество тайн, о которых сестрам лучше было бы не знать. То, что героини узнают о своей семье, навсегда меняет их видение происходящего. Мир уже никогда не будет прежним, а жизнь избрала новое течение.', '2018-06-11 12:00:15', 55, 0, 'vida', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]');
INSERT INTO `kansai_posts` (`id`, `season`, `title`, `original_title`, `totalseries`, `rating`, `rators`, `torrent`, `poster`, `description`, `updated_at`, `views`, `isHidden`, `url`, `additional`) VALUES
(97, 0, 'Древние (Пятый сезон)', 'The Originals', 3, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fdrevnie%2Fthumbnail.webp?alt=media&token=171213b4-908e-43cf-acd2-6be2d9674a52', 'До того, как появились вампиры, миром правили Первородные. Спустя долгие годы Клаус Майклсон возвращается в родной Новый Орлеан, который он когда-то помог построить. Там он встречает своего старого друга и ученика Марселя. Последний навел в городе свои порядки и установил строгие правила на колдовство ведьм. Все это не касалось Клауса (который особо и не интересовался), пока однажды он не услышал, как бьется сердце его еще не рожденного ребенка. Появление наследника Первородного никак не укладывалось в новые порядки Марселя, поэтому теперь Клаусу предстоит сделать важнейший выбор в своей жизни.', '2018-06-11 12:00:15', 96, 0, 'drevnie', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(98, 0, 'Персона пять', 'Persona 5 the Animation', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fpersona-pyat%2Fthumbnail.webp?alt=media&token=a0a97f45-69f6-4230-8e31-9bd040ebfad0', 'Несправедливо осуждённый в несовершённом им преступлении, Амамия Рен оказался вынужден переехать в Токио к другу семьи и сменить школу. В течение одного года испытательного срока, ему нужно делать лишь одно: жить честной жизнью обычного ученика…', '2018-06-11 12:00:16', 418, 0, 'persona-pyat', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(99, 0, 'Повар небесной гостиницы', 'Kakuriyo no Yadomeshi', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fpovar-nebesnoy-gostinitsy%2Fthumbnail.webp?alt=media&token=b32ffc35-9786-4d0f-bdd8-d47c4f35af05', 'Девятнадцатилетняя студентка Аой унаследовала от своего дедушки способность видеть аякаши. Однажды перед Аой появился демон и заявил, что у её дедушки перед ним огромный долг, и поэтому она должна стать его невестой. Аой должна выйти замуж за демона! Но она отказывается, решив самостоятельно заработать деньги и выплатить долг.', '2018-06-11 12:00:16', 1638, 0, 'povar-nebesnoy-gostinitsy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(100, 0, 'Трусливый велосипедист. Черта славы.', 'Yowamushi Pedal: Glory Line', 19, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Ftruslivyy-velosipedist-cherta-slavy%2Fthumbnail.webp?alt=media&token=39619804-a58b-417d-ba7b-540b31891629', 'История оригинальной манги рассказывает о Сакамичи Оноде, отаку из старшей школы Сохоку. Он так сильно любит аниме и игры, что готов проезжать на своём велосипеде 90 километров в Акихабару и обратно после школы. Жизнь Оноды меняется, когда он встречает команду велосипедистов из своей школы и, присоединившись к ним, начинает свой путь в велоспорте.', '2018-06-11 12:00:17', 684, 0, 'truslivyy-velosipedist-cherta-slavy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(101, 0, 'Моя геройская академия (3 сезон)', 'Boku no Hero Academia 3rd Season', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fmoya-geroyskaya-akademiya-3-sezon%2Fthumbnail.webp?alt=media&token=5f3f8f9f-54d9-4c08-af20-dd186b4d4070', 'Пришло лето, и герои классов 1-А и 1-Б отправляются в самый суровый тренировочный лагерь в их жизни! Группа опытных профессионалов помогает ученикам в достижении новых высот с их силами, ребята преодолевают одно испытание за другим. Рутинная тренировка превращается в борьбу за выживание!\n', '2018-06-11 12:00:18', 990, 0, 'moya-geroyskaya-akademiya-3-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(102, 0, 'Алиса или Алиса: Брат-сестролюб и его сёстры-близняшки', 'Alice or Alice: Siscon Niisan to Futago no Imouto', 7, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Falisa-ili-alisa-brat-sestrolyub-i-ego-sestry-bliznyashki%2Fthumbnail.webp?alt=media&token=8fad0c5b-2895-4cb1-b291-487475b60538', 'Повседневная жизнь близняшек Аири и Рисы и влюблённого в них брата. Вы сможете увидеть, как они кушают, ссорятся, играют с друзьями. ', '2018-06-11 12:00:19', 190, 0, 'alisa-ili-alisa-brat-sestrolyub-i-ego-sestry-bliznyashki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(103, 0, 'Бойтесь ходячих мертвецов (четвёртый сезон)', 'Fear the Walking Dead', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fboytes-khodyachikh-mertvetsov-chetvertyy-sezon%2Fthumbnail.webp?alt=media&token=bf9a109a-1d95-4a95-8def-a744577ec29f', 'Действия сериала происходят параллельно с событиями зомби-апокалипсиса, показанными в сериале «Ходячие мертвецы», но в совершенно другом месте — Лос-Анджелесе. В центре сюжета находится семья матери-одиночки и консультанта по профессиям Мэдисон Кларк и разведённого учителя Трэвиса Манавы, которые вместе пытаются выжить в зомби-апокалипсисе.', '2018-06-11 12:00:20', 225, 0, 'boytes-khodyachikh-mertvetsov-chetvertyy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(104, 0, 'Иназума 11: Весы Ареса', 'Inazuma Eleven: Ares no Tenbin', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Finazuma-11-vesy-aresa%2Fthumbnail.webp?alt=media&token=fc06e777-65eb-4a8d-9ec5-934c85c1a8dc', 'История разворачивается вокруг живущих на острове ребят, которые очень любят играть в футбол. Внезапно их футбольный клуб закрывают, и единственный способ вернуть его - это выиграть чемпионат по футболу.\nАсуто Инамори и его товарищи покидают остров и отправляются в Токио, чтобы поступить в школу Раймон и принять участие в чемпионате. ', '2018-06-11 12:00:20', 51, 0, 'inazuma-11-vesy-aresa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(105, 0, 'Рассказ служанки (Второй сезон)', 'The Handmaid\'s Tale', 1, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Frasskaz-sluzhanki-vtoroy-sezon%2Fthumbnail.webp?alt=media&token=8b3bbbac-9bac-43e4-8aa5-ee2c74148ed9', 'Действие разворачивается в будущем, в республике Гилеад, где у власти стоят военные. В стране жестокие порядки и нравы, уважением в обществе пользуются только офицеры и их жёны. Помимо тоталитарного устройства общества, в мире будущего есть серьёзная проблема — бесплодие. Лишь каждая сотая женщина способна к воспроизведению потомства. Чтобы продолжить офицерский род, семьи берут в дом служанку — суррогатную мать из числа простых женщин, способных к деторождению. Исполнив долг, служанка должна расстаться со своим ребёнком и перейти на службу к новым хозяевам.', '2018-06-11 12:00:21', 177, 0, 'rasskaz-sluzhanki-vtoroy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(106, 0, 'Стальная тревога! Искусная победа', 'Full Metal Panic! Invisible Victory', 3, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fstalnaya-trevoga-iskusnaya-pobeda%2Fthumbnail.webp?alt=media&token=2da927de-eec2-403f-8756-9db979bf3fdc', 'История берёт начало после Второго Рейда. Борьба двух противостоящих организаций - Амальгамы и Мифрила - накаляется.', '2018-06-11 12:00:22', 151, 0, 'stalnaya-trevoga-iskusnaya-pobeda', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(107, 0, 'A.I.C.O.: Воплощение', 'A.I.C.O.: Incarnation', 6, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D0%B9%2Fa-i-c-o-voploschenie%2Fthumbnail.webp?alt=media&token=871fc5ff-3070-4959-ad90-be150137c792', 'Ближайшее будущее, Япония, 2035 год. В результате масштабного инцидента, возникшего в ходе исследования искусственной жизни, вещество, названное \"\"Материей\"\", разрушило ущелье Куробэ. Правительство запретило въезд в исследовательский город, который считался последней надеждой человечества.\nДва года спустя пятнадцатилетняя девушка Айко Тачибана, потерявшая в той катастрофе всю свою семью, узнаёт от переведённого ученика Юи Канзаки о секрете, скрытом в её собственном теле. Ключ к разгадке находится в Первичной Точке - эпицентре произошедшей трагедии. Когда встречаются двое, в чьих руках находится будущее человечества, какой будет новая истина?', '2018-06-11 12:00:22', 286, 0, 'a-i-c-o-voploschenie', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(108, 0, 'Вы ещё не знаете Гуммы', 'Omae wa Mada Gunma wo Shiranai', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fvy-esche-ne-znaete-gummy%2Fthumbnail.webp?alt=media&token=42326632-d8e7-422f-82f3-4ab4ec53aec5', 'Нори Камитсуки переезжает из Тибы в префектуру Гумма. Чуть позже новый одноклассник предупреждает его, что \"Из Гуммы живыми не возвращаются.\" Пытаясь понять, что это значит, он пробует отыскать информацию в интернете, но в итоге узнает еще больше дурного о Гумме. Обескураженный и не привыкший к новым реалиям, Нори понимает, что оказался втянут в соперничество между префектурами Японии: Тотики, Гуммой и Ибараки', '2018-06-11 12:00:23', 258, 0, 'vy-esche-ne-znaete-gummy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(109, 0, 'Мегалобокс', 'Megalo Box', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fmegaloboks%2Fthumbnail.webp?alt=media&token=a2778a62-2d96-44a5-90d7-ac82fa42f89c', 'JD зарабатывает на жизнь подпольными боксёрскими боями. Сегодня ему тоже предстоит выйти на ринг, но уже против определённого человека. Герой рискует всем и принимает вызов.', '2018-06-11 12:00:23', 447, 0, 'megaloboks', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(110, 0, 'Меч Гая', 'Sword Gai: The Animation', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fmech-gaya%2Fthumbnail.webp?alt=media&token=df0a0f0a-0278-4319-95b3-fc303e41952e', 'Однажды кузнец-оружейник Амон встречает в лесу тело мертвой женщины, а рядом с ней и вовсе неожиданную находку – новорожденного малыша. Пожалев сироту с такой трагической судьбой, оружейник решает приютить его, позже назвав Гаем. Спустя время мальчик обживается в доме у кузнеца и вскоре становится его подмастерьем. Но в возрасте десяти лет, в процессе изготовления меча, по неосторожности теряет правую руку. Тогда Амон решает перековать древний демонический меч в протез для Гая, после присоединения которого к своему телу мальчик становится единым целым с оружием и получает огромную силу. Так начитаются приключения Гая, в которых он вновь и вновь будет сталкиваться с жестокой судьбой и бесчисленным множеством врагов. О чем расскажет эта история? О прекрасном оружии и уродливой личности? Или о жестокости оружия и великолепии человека?', '2018-06-11 12:00:24', 707, 0, 'mech-gaya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(111, 0, 'Золотое божество', 'Golden Kamuy', 4, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fzolotoe-bozhestvo%2Fthumbnail.webp?alt=media&token=29a3703b-60ed-4cee-ab78-472c38e4b109', 'История разворачивается на Хоккайдо, в северных землях Японии и повествует о мужчине по имени Сугимото, который пережил Русско-Японскую войну. Теперь он, одержимый золотой лихорадкой, пытается найти богатства, чтобы помочь овдовевшей жене своего ныне покойного военного товарища. В своих поисках он натыкается на подсказки, ведущие к залежам золота. Вместе с девушкой-айну они отправляются в приключения и участвуют в настоящей битве на выживание против преступников, которые тоже ищут скрытый тайник.', '2018-06-11 12:00:25', 319, 0, 'zolotoe-bozhestvo', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(112, 0, 'В пустыне смерти (Третий сезон)', 'Into the Badlands', 2, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8C%2Fv-pustyne-smerti-tretiy-sezon%2Fthumbnail.webp?alt=media&token=1e4c574d-101d-4f7e-a124-cdada671901c', 'Сериал про воина по имени Санни, сопровождающего в пути по бесплодным землям юного мальчика.', '2018-06-11 12:00:26', 390, 0, 'v-pustyne-smerti-tretiy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(113, 0, 'Медленный старт', 'Slow Start', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fmedlennyy-start%2Fthumbnail.webp?alt=media&token=f1ba1789-0342-4318-9586-d460fa25e71f', 'Хана Ичиносэ — обычная шестнадцатилетняя школьница. Однако есть в ней и кое-что не совсем обычное: она пошла в старшую школу на год позже и сильно комплексует. Её одноклассники не знают об этом, и Хана будет прилежно трудиться, чтобы сравняться с остальными.', '2018-06-11 12:00:27', 1092, 0, 'medlennyy-start', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(114, 0, 'Судьба/Экстра. На бис', 'Fate/Extra Last Encore', 8, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8C%2Fsudba-ekstra-na-bis%2Fthumbnail.webp?alt=media&token=1597d76c-9425-4298-bd2f-76ac4e0711bf', 'Хакуно Кишинами, неожиданно для самого себя оказывается в неизвестном виртуальном мире. Он не понимает, что происходит вокруг, но уже втянут в круговорот событий, происходящих здесь. Но ясно одно - ему нужно выжить, причём любой ценой. Победу придётся одержать в войне, происходящей в виртуальном мире, нужно стать первым среди 128 участников этой битвы. Проигрыш карается смертью, как в виртуальном мире, так и в реальном, поэтому ставки очень высоки. Понятие друзей и врагов быстро стирается, Хакуно должен противостоять всем подряд. Но, в отличие от других претендентов на победу, яростно желающих заполучить себе Святой Грааль, у Хакуно несколько другие цели. Он просто хочет жить, а также понять, кто он такой на самом деле.', '2018-06-11 12:00:27', 1901, 0, 'sudba-ekstra-na-bis', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(115, 0, 'Гинтама (7 сезон)', 'Gintama (TV7)', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fgintama-7-sezon%2Fthumbnail.webp?alt=media&token=17f662b1-4045-4fd3-ac54-1aeea842b80d', 'Неладно что-то в датском королевстве… Ой, в альтернативной Японии! А значит, великий самурай и не менее великий раздолбай Гинтоки Саката ещё не готов повесить на гвоздь свой боккен. Бок о бок с ним, как всегда, верный ученик Шинпачи и очаровательная обжора-инопланетянка Кагура. Их ждёт очередное безумное, сносящее крышу и пробирающее неудержимым хохотом приключение, в котором наш герой снова будет принимать решения на грани фола. И нельзя забывать о том, что по пятам неотступно следуют Шинсенгуми во главе со своим неутомимым капитаном, страстным любителем маянезика и заклятым другом Гинтоки - Тоширо Хиджикатой...', '2018-06-11 12:00:28', 800, 0, 'gintama-7-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(116, 0, 'Двадцатипятилетняя школьница', '25-sai no Joshikousei', 10, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fdvadtsatipyatiletnyaya-shkolnitsa%2Fthumbnail.webp?alt=media&token=ac4c9f2b-808e-47c7-8d93-803219778763', 'Романтическая история сосредотачивается вокруг Ханы Натори, серьезной и добродушной 25-летней женщине, чей двоюродный брат отказывается ходить в старшую школу. Хана решает занять место своего кузена и посещать школу. Однако в первый же день Хана встречает своего бывшего одноклассника, Окито Кани, который является учителем истории.', '2018-06-11 12:00:29', 1618, 0, 'dvadtsatipyatiletnyaya-shkolnitsa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(117, 0, 'Виолетта Эвергарден', 'Violet Evergarden', 13, '10', '1', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fvioletta-evergarden%2Fthumbnail.webp?alt=media&token=20eab157-562a-4e28-bae4-4f288a3035a2', 'Вайолет Эвергарден, молодая девушка, чья жизнь — не что иное, как война, послушно служит под командованием майора Гилберта Бугенвиллеи из армии Ляйденшафтлиха.\nПосле серьёзных увечий, оставивших её без рук и разделивших с Гилбертом, она покинула поле боя и была взята под опеку бывшим командующим армии Клаудией Ходжинсом, который после окончания войны основал почтовую службу «C-H» в крупном портовом городе Ляйден. Эта компания осуществляет регулярные почтовые пересылки и предоставляет услуги «автозапоминающих кукол» — талантливых девушек, в чьи обязанности входит написание писем и корректировка текста для большей части неграмотного населения города.', '2018-06-11 12:00:29', 4924, 0, 'violetta-evergarden', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(118, 0, 'Невеста Чародея', 'Mahoutsukai no Yome', 24, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fnevesta-charodeya%2Ftorrent-720.torrent?alt=media&token=07d96279-e383-4043-9412-dfd0a1a8611a\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fnevesta-charodeya%2Ftorrent-1080.torrent?alt=media&token=260ddc2c-6f5f-4439-b47f-d35447965b9a\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fnevesta-charodeya%2Fthumbnail.webp?alt=media&token=5b114e5e-02a0-46ed-ab6d-2eea3ee163c8', 'Чисэ Хатори - очень одинокая девочка. Всё потому, что с самого рождения она видит то, что для других незаметно. Её постоянно окружают жуткие существа - призраки, демоны, духи. Отчаявшись понять дочку, её мать покончила с собой, и началось долгое, безрадостное путешествие Чисэ по родственникам, каждый из которых недолюбливал воспитанницу или даже боялся. Но однажды её, уже взрослую девушку, выкупает - да-да, за деньги! - загадочный человек, называющий себя чародеем. Теперь Чисэ ждёт новая жизнь в далёкой Англии, где она станет ученицей чародея Элиаса, а когда-нибудь - его женой.', '2018-06-11 12:00:30', 8168, 0, 'nevesta-charodeya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(119, 0, 'Любовь - словно прошедший дождь', 'Koi wa Ameagari no You ni', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Flyubov-slovno-proshedshiy-dozhd%2Fthumbnail.webp?alt=media&token=408b4fb3-77b4-47d7-b1b7-a524b4abcebd', 'Акира Тачибана – тихая старшеклассница, решившая устроиться на подработку в семейный ресторанчик. Её руководителем становится Кондо Масами, в которого девушка начинает всё сильнее и сильнее влюбляться. Но вот незадача: он женат, ему 45 и у него есть сын...', '2018-06-11 12:00:30', 1972, 0, 'lyubov-slovno-proshedshiy-dozhd', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(120, 0, 'Владыка (второй сезон)', 'Overlord II', 13, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fvladyka-vtoroy-sezon%2Fthumbnail.webp?alt=media&token=726ddd6f-16cc-4108-8626-09b1757a60b0', 'Однажды, во время очередной миссии, одной из верных NPC Момонги по имени Шалтия промыли мозги, и она решила убить своего бывшего хозяина. Битва с ней далась ему крайне нелегко, но в итоге он сумел перехитрить Шалтию и уничтожить её. В своём замке он возрождает девушку обратно в NPC, и она вновь обретает ясность ума. Теперь нужно выяснить, что за злой умысел стоял за её действиями, и кто дёргал за ниточки марионетки, пытаясь устранить могущественного соперника?', '2018-06-11 12:00:31', 5077, 0, 'vladyka-vtoroy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(121, 0, 'Выпиваем дома', 'Takunomi', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fvypivaem-doma%2Fthumbnail.webp?alt=media&token=54348994-3fbc-45f5-98d1-845d629b2a9a', '20-летняя Мичиру Амацуки переехала в Токио из-за смены карьеры. Она решила жить в женском доме «Stella House Haruno» с людьми разного возраста и увлеченный . Это всегда весело, когда есть алкоголь и вкусная еда!', '2018-06-11 12:00:33', 789, 0, 'vypivaem-doma', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(122, 0, 'Мартовский Лев (2 сезон)', '3-gatsu no Lion TV2', 21, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2030%203-gatsu%20no%20Lion%2F%5BKANSAI%5D_3-gatsu_no_Lion_TV2_%5B720p%5D.torrent?alt=media&token=018fefe1-ddd8-4420-8aa9-981a84e2a32e\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2030%203-gatsu%20no%20Lion%2F%5BKANSAI%5D_3-gatsu_no_Lion_TV2_%5B1080p%5D.torrent?alt=media&token=1dc930d0-1c69-465e-806b-d1f78ae42994\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fmartovskiy-lev-2-sezon%2Fthumbnail.webp?alt=media&token=22750920-48f1-40a9-b733-9e042a069992', 'Поживали люди, и горя не ведали, пока не наступил момент, когда невесть откуда пришли великаны, рост которых достигал пятнадцати метров, и которые фактически все население съели. Уцелевшие люди оградились от них 50-метровой стенкой, и на «защищенной» территории возвели города-крепости. Так они за забором и прожили целое столетие, наивно предполагая, что опасности больше нет. Но вот появился 60-метровый титан, легко пробивший внешний периметр стены и пропустивший более мелких титанов. Вот теперь-то все и закрутится с новоявленной силой. А чем все закончится, вы узнаете, когда посмотрите этот увлекательный сериал.', '2018-06-11 12:00:34', 931, 0, 'martovskiy-lev-2-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(123, 0, 'Марш Смерти к рапсодии параллельного мира', 'Death March kara Hajimaru Isekai Kyousoukyoku', 12, '9', '1', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fmarsh-smerti-k-rapsodii-parallelnogo-mira%2Fthumbnail.webp?alt=media&token=35fb3440-01d6-4e33-a594-0de39ed3cace', 'Ичиро Сузуки устал от повседневной жизни и только в играх он находит спасение. И, однажды, закрыв глаза, он просыпается в одной из таких игр. Только теперь он почему-то в два раза младше и зовут его Сато. Но кому это важно, если тебя ждут девчонки, еда и веселье? И даже надвигающееся вторжение Короля Демонов неспособно омрачить эту новую прекрасную жизнь!', '2018-06-13 18:02:57', 3131, 0, 'marsh-smerti-k-rapsodii-parallelnogo-mira', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":\"2018\",\"ishidden\":\"on\"}]'),
(124, 0, 'Сказочные девушки', 'Märchen Mädchen', 10, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fskazochnye-devushki%2Fthumbnail.webp?alt=media&token=0da5643f-d4a9-4f4c-98f8-9a302574b604', 'Это история о Хазуки Кагимуре, которая не ладила с семьёй и потому нашла для себя близкого друга в лице книг. Однажды она затерялась среди множества шкафов в школьной библиотеке и открыла для себя мир таинственной школы магии. Школы, где учениц выбирают волшебные книги. Хадзуки достаётся «Золушка», и вместе с тем она начинает двигаться по пути к званию настоящей волшебницы.', '2018-06-11 12:00:35', 1169, 0, 'skazochnye-devushki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(125, 0, 'Тонкоцу-рамен из Хакаты', 'Hakata Tonkotsu Ramens', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Ftonkotsu-ramen-iz-khakaty%2Fthumbnail.webp?alt=media&token=4ff22ed1-3948-4158-92d2-6ef9f396edb9', 'История разворачивается в торговой части крупного портового города Фукуока под названием Хаката. С виду это место кажется мирным, но в действительности является пристанищем для разного рода преступников. В этом районе бок о бок живут профессиональные киллеры, информаторы, детективы, мстители, пыточных дел мастера и многие другие не слишком приятные личности. А местная городская легенда гласит, что где-то здесь обитает «убийца профессиональных убийц»...', '2018-06-11 12:00:36', 1810, 0, 'tonkotsu-ramen-iz-khakaty', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(126, 0, 'Хакумэ и Микочи', 'Hakumei to Mikochi', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fkhakume-i-mikochi%2Fthumbnail.webp?alt=media&token=35a3aa6b-8d43-4c06-8dde-aa01ebf976cd', 'Хакумэ и Микочи ростом всего 9 сантиметров. Они живут в лесу в маленьком домике на дереве. Ездят верхом на птицах и насекомых, делают зонтики из листьев и ведут простую жизнь. Но в их мире, полном богов и легенд, чудеса всегда случаются там где их не ждешь...', '2018-06-11 12:00:37', 1189, 0, 'khakume-i-mikochi', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(127, 0, 'Гаро: Линия Cхода', 'Garo: Vanishing Line', 23, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2024%20Vanishing%20Line%2F%5BKANSAI%5D_Garo_-_Vanishing_Line_TV_%5B720p%5D.torrent?alt=media&token=2141e2ea-6cfa-475b-9f87-9d563c9d491c\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2024%20Vanishing%20Line%2F%5BKANSAI%5D_Garo_-_Vanishing_Line_TV_%5B1080p%5D.torrent?alt=media&token=8d56befe-0648-40f4-aaf2-ba6b55900240\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fgaro-liniya-ckhoda%2Fthumbnail.webp?alt=media&token=be0ec2bc-56c9-4a1a-a9e9-adc24900d601', 'Добро пожаловать в процветающий город Рассел. Кажется, жизнь здесь протекает размеренно и благополучно, пока внезапно не начинают происходить загадочные и необъяснимые происшествия. Парень по имени Сворд становится одним из тех, кто узнаёт о скрытой угрозе, и решает бросить все свои силы на её устранение. Но его сестра загадочно исчезает и единственная подсказка — это слово «Эльдорадо». Гуляя по ночному городу в раздумьях, Сворд встречает девушку Софи, чей брат тоже бесследно пропал, оставив ей лишь одно послание с теми же словами. Сворд решает объединить свои усилия вместе с Софией, чтобы разузнать тайну этих загадочных слов.', '2018-06-11 12:00:38', 3049, 0, 'garo-liniya-ckhoda', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(128, 0, 'Смертельные клыки', 'Killing Bites', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fsmertelnye-klyki%2Fthumbnail.webp?alt=media&token=a517c9f5-4cc7-4ffb-89ab-b78d976bfbda', 'В мире этого аниме вокруг боёв искусственно созданных зверолюдей создан крупный бизнес. Однажды студент колледжа Номото Юйа соглашается покатать по городу своих случайных знакомых, чтобы те смогли подцепить девчонок. Вот только цеплять их они собрались силой. Их жертвой становится девушка-гибрид Хитоми, которая расправляется со всеми, кроме Юйи. Хитоми скрещена с барсуком-медоедом, слывущим самым бесстрашным животным, и теперь она должна остаться с Юйей для его защиты!', '2018-06-11 12:00:38', 1601, 0, 'smertelnye-klyki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(129, 0, 'Эпичная попса', 'Poputepipikku', 11, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fepichnaya-popsa%2Fthumbnail.webp?alt=media&token=5e21e39d-d94b-4518-8cf5-cdbd994bd49e', 'Две старшеклассницы – коротышка со взрывным характером Попуко и высокая и куда более сдержанная Пипими чудят на всю катушку и матерятся как сапожники в комедии абсурда, переполненной отсылками.', '2018-06-11 12:00:39', 1564, 0, 'epichnaya-popsa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(130, 0, 'Магазинчик сладостей (второй сезон)', 'Dagashi Kashi 2', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fmagazinchik-sladostey-vtoroy-sezon%2Fthumbnail.webp?alt=media&token=f41f9eb9-9cd0-4076-ba48-e3f2250815e4', 'Коконоцу Шикада живёт в провинциальном городке, а его отец Йо владеет семейным бизнесом, магазинчиком, продающим японские сладости. Магазинчик этот передаётся из поколения в поколение, и Йо является уже восьмым наследником этого бизнеса. Однажды о магазинчике сладостей узнаёт знаменитая компания, производящая\nвкусности. И владелец этой компании отправляет свою дочь Хотару на переговоры с Йо, с целью завербовать его в свой бизнес. Йо соглашается, но он не хочет закрывать свой магазин, а значит Коконоцу должен вступить в наследство. Чтобы заполучить талантливого кондитера себе, Хотару решает во что бы то ни стало уговорить Коконоцу стать девятым владельцем магазинчика сладостей.', '2018-06-11 12:00:40', 706, 0, 'magazinchik-sladostey-vtoroy-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(131, 0, 'Парни из «Санрио»', 'Sanrio Danshi', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fparni-iz-sanrio%2Fthumbnail.webp?alt=media&token=d0080a27-1162-40ca-b2b2-f7fc05ae537e', 'Кота Хасегава – старшеклассник, которому нравится собачка Пом Пом Пурин. Так уж вышло, что он ходит в одну школу с Ю Мизуно, которому нравится зайчик Моя Мелодия. Ю говорит Коте, что не стоит стесняться того, что ему нравится милые персонажи бренда «Санрио». Вместе Кота, Ю, Шунсуке Ёшино, Рю Нишимия и Сейчиру Минамото учатся принимать свою любовь к этим героям и не стесняться её.', '2018-06-11 12:00:41', 464, 0, 'parni-iz-sanrio', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(132, 0, 'Место, что за пределами вселенной', 'Sora yori mo Tooi Basho', 13, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fmesto-chto-za-predelami-vselennoy%2Fthumbnail.webp?alt=media&token=cdd6fdc8-e030-48de-bc77-32f8103528d1', 'Отправлялись ли вы когда-нибудь во внезапное путешествие? Так, чтобы сорваться с места ни с того, ни с сего и поехать, куда глаза глядят? А может быть вам хотелось бы так поступить? Мари Тамаки давно об этом мечтала, аж со средней школы. Но в суете занятой школьной жизни она позабыла о своём давнем желании. Вспомнила о нём, лишь когда нашла свой старый дневник, и тут же загорелась по новой. Правда страх оказался сильнее неё, и она так и не смогла пересилить себя и отправиться куда-то одна. Так и отказалась Мари от своей мечты, пока однажды на станции не встретила Ширасе Кобучизаву, странную девочку из её школы, которую все называют безумной.', '2018-06-11 12:00:42', 1311, 0, 'mesto-chto-za-predelami-vselennoy', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(133, 0, 'Коты-Работяги', 'Hataraku Onii-san!', 13, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fkoty-rabotyagi%2Fthumbnail.webp?alt=media&token=b8e9e63f-07d8-4198-9751-e8685312b09e', 'Сюжет повествует про двух приятелей-студентов — оптимиста Тапио Чаторадзаву и пессимиста Куехико Рощихару, которые вместе учатся и вместе же ищут (и находят) разнообразные подработки. А ещё они котики. Тапио — трёхцветный; Куехико — русский голубой.', '2018-06-11 12:00:42', 508, 0, 'koty-rabotyagi', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(134, 0, 'Руна', 'Kokkoku', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fruna%2Fthumbnail.webp?alt=media&token=a11732ef-4b87-4734-af4d-9d877f481cb3', 'Семья Юкава владеет потрясающим артефактом, способным останавливать время! Но это является настолько строгим секретом, что юная Джури Юкава могла и не узнать о таинственном камне, если бы однажды похитители не выкрали ее брата и племянника. Вот здесь дедушка и посвящает её в фамильную тайну, передав временной камень, чтобы та могла спасти своих близких.', '2018-06-11 12:00:43', 2314, 0, 'runa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(135, 0, 'Работёнка для чемпиона', 'Ryuuou no Oshigoto!', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Frabotenka-dlya-chempiona%2Fthumbnail.webp?alt=media&token=0f2329aa-e365-4f9d-8a73-6c1614c53d8f', 'Мальчик-подросток по имени Яичи — мастер игры в Шоги. Однажды на пороге егодома появляется девятилетняя девочка Ай, объяснившая свой приход тем, что онахочет стать его наставницей. С этого момента начинается «игра», наполненная множеством нелепых шуток и безумным весельем!', '2018-06-11 12:00:43', 1189, 0, 'rabotenka-dlya-chempiona', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(136, 0, 'Школьные няньки', 'Gakuen Babysitters', 11, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fshkolnye-nyanki%2Fthumbnail.webp?alt=media&token=e8d4e899-53f7-4a37-85c6-334c8ae08740', 'Родители Рюичи и его маленького братика Котаро погибли в авиакатастрофе. Сирот берёт под свою опеку председательница элитной академии - до жути строгая и безмерно добрая женщина, которую наши ребята до этого ни разу не видели. Из-за сложившихся обстоятельств Рюичи вынужден работать нянькой в детском саде при академии и присматривать за малышами здешних учителей.', '2018-06-11 12:00:44', 1055, 0, 'shkolnye-nyanki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(137, 0, 'Би: Начало', 'B: The Beginning', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D0%BC%D0%B0%D1%80%D1%82%2F-en-znachit-nachalo%2Fthumbnail.webp?alt=media&token=cc853068-565c-4f3b-878a-e13f87658389', 'История разворачивается в мире, который смог достичь больших успехов в области развития технологий и компьютерных сетей, а также открыть архипелажную нацию Кремона.\nГлавному герою Коку и Киту, являющемуся легендарным следователем королевской полиции RIS, предстоит разобраться с таинственной преступной организацией. Однако, помимо преступной группировки, городу угрожает ещё нечто страшное, а именно череда таинственных и жестоких серийных убийств, на месте которых можно обнаружить подпись убийцы «Эн», чью личность, а также цель преступлений и необходимо будет раскрыть героям.', '2018-06-11 12:00:45', 1859, 0, '-en-znachit-nachalo', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(138, 0, 'Годзилла. Планета Чудовищ', 'Godzilla: Kaijuu Wakusei', 1, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2027%20Godzilla%2FPLAKAT%20Godzilla.jpg?alt=media&token=6bd9e38f-7c11-48da-9572-0115db648b22', 'Человечество слишком долго истязало родную планету. И планета решила ответить. Чудовищный монстр погубил основное население, а жалкие остатки заставил сбежать в космос с поджатыми хвостами. Но настал день людям вернуть свой дом... Или так они думали, пока не выяснили, что на Земле прошло уже двадцать тысяч лет! Чтобы снова заселить некогда обжитые места, блудным сыновьям Земли придётся свыкнуться с переменами во флоре и фауне... А также вновь встретиться лицом к лицу со своим кошмаром - Годзиллой... ', '2018-06-11 12:00:45', 3276, 0, 'godzilla', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(139, 0, 'Насмешница Такаги-сан', 'Karakai Jouzu no Takagi-san', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fnasmeshnitsa-takagi-san%2Fthumbnail.webp?alt=media&token=7e7a6a96-e616-4a9f-9d8a-fd6f58f90ba2', '\"И чего она докопалась до меня?” - вопрошает в который раз несчастный Нишиката, которому крайне повезло сидеть рядом с Такаги. Настолько повезло, что буквально ни дня не обходится без того, чтобы она его не подколола, не задела, не разыграла и не высмеяла. Причина такого поведения неизвестна, возможно, ей просто нравится издеваться над Нишикатой, ведь, несмотря на то, что от Такаги каждую секунду можно ожидать подвоха, он всегда успешно ведётся на все её коварные задумки.', '2018-06-11 12:00:46', 1254, 0, 'nasmeshnitsa-takagi-san', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(140, 0, 'Коллекция Ито Дзюндзи', 'Ito Junji: Collection', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fkollektsiya-ito-dzyundzi%2Fthumbnail.webp?alt=media&token=0b776538-e088-4506-b655-00f8eee52a6a', 'В данном аниме представлены страшные истории, основанные на работах японского художника Дзюндзи Ито. Совмещая в себе сверхъестественные элементы и резкие, почти безумные изменения в личностях героев, истории Дзюндзи Ито вполне способны вселить чувство ужаса и безысходности даже в самых искушённых зрителей...', '2018-06-11 12:00:47', 1428, 0, 'kollektsiya-ito-dzyundzi', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(141, 0, 'Цитрус', 'Citrus', 12, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Ftsitrus%2Fthumbnail.webp?alt=media&token=c14b482f-3746-428e-a9b5-05d7e808fe9e', 'Главная героиня Юзу Аихара пережила развод родителей. Но это в прошлом. Сейчас она живет в новом доме вместе с отчимом и ходит в девичью школу. Но в ней, из-за старомодных порядков, у Юзу много проблем. В особенности её раздражает вечно правильная Мэй, президент студсовета, и по совместительству - дочь её отчима. В новом доме им предстоит жить не только под одной крышей, но и\nв одной комнате. Со временем, неприязнь сменяется\nна привязанность, а сердце Юзу начинает странно биться в присутствии сводной сестры.', '2018-06-11 12:00:48', 2201, 0, 'tsitrus', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(142, 0, 'Семь добродетелей', 'Nanatsu no Bitoku', 5, '0', '', 'null', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2018-%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8C%2Fsem-dobrodeteley%2Fthumbnail.webp?alt=media&token=02af2406-fc05-45c1-9d94-350bff6389c7', 'На каждое зло всегда найдётся добро. Действия Семи Смертных Грехов непростительны. Небеса и его обитатели решают наказать демонов, развращающих человеческий мир, для чего отправляют семерых архангелов, каждый из которых воплощает одно из Небесных Добродетелей: Михаэль, Уриэль, Сариэль, Сэндалфин, Метатрон, Рафаэль и Габриэль. Казалось бы, лучше команды для борьбы с демонами не собрать, но все эти ангелы оказались попросту бесполезными. Есть ли шанс у них против куда более способных Семи Смертных Грехов?', '2018-06-11 12:00:49', 1102, 0, 'sem-dobrodeteley', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2018,\"ishidden\":\"on\"}]'),
(143, 0, 'Гинтама (6 сезон)', 'Gintama (TV6)', 13, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2001%20Gintama%2FPLAKAT%20GINTAMA%20TV6.jpg?alt=media&token=3bee16ea-e143-47a5-b237-57fb11e46317', 'Неладно что-то в датском королевстве… Ой, в альтернативной Японии! А значит, великий самурай и не менее великий раздолбай Гинтоки Саката ещё не готов повесить на гвоздь свой боккен. Бок о бок с ним, как всегда, верный ученик Шинпачи и очаровательная обжора-инопланетянка Кагура. Их ждёт очередное безумное, сносящее крышу и пробирающее неудержимым хохотом приключение, в котором наш герой снова будет принимать решения на грани фола. И нельзя забывать о том, что по пятам неотступно следуют Шинсенгуми во главе со своим неутомимым капитаном, страстным любителем маянезика и заклятым другом Гинтоки - Тоширо Хиджикатой...', '2018-06-11 12:00:49', 1286, 0, 'gintama-6-sezon', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(144, 0, 'А просто так!', 'Just Because!', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2012%20Just%20Because%2F%5BKANSAI%5D_Just_Because!_TV_%5B720p%5D.torrent?alt=media&token=b9d0031c-5e52-43e2-b564-877f8bd1731d\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2012%20Just%20Because%2F%5BKANSAI%5D_Just_Because!_TV_%5B1080p%5D.torrent?alt=media&token=6c72f3e1-86ff-41c4-8008-688ba949911csoon\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2012%20Just%20Because%2FPLAKAT%20Just%20Because%20(1).jpg?alt=media&token=2093a506-3e58-448b-ba9e-7a374333b22b', 'Второй семестр одиннадцатого класса. Время, когда головы школьников пухнут от подготовки к экзаменам и неизвестности приближающейся взрослой жизни. Казалось бы, как вместить в такой насыщенный период жизни что-то, кроме волнений о будущем? Так и думают четверо друзей-одноклассников, пока в один прекрасный день в школу не возвращается их товарищ из средней школы. ', '2018-06-11 12:00:50', 2246, 0, 'a-prosto-tak', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(145, 0, 'Игра Короля', 'Ousama Game', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2018%20Ousama%20Game%2F%5BKANSAI%5D_Ousama_Game_TV_%5B720p%5D.torrent?alt=media&token=4de86a1b-8193-43f8-b6e2-8a09e56e4091\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2018%20Ousama%20Game%2F%5BKANSAI%5D_Ousama_Game_TV_%5B1080p%5D.torrent?alt=media&token=79c12488-a9ad-4999-b63e-836814d445c2\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Figra-korolya%2Fthumbnail.webp?alt=media&token=50a12e39-422a-4434-963a-a5b8e5fc79d1', 'Однажды ночью все ученики класса 2А получают странное электронное письмо - «Игра Короля». Если они не выполнят «приказ» в течение 24 часов – их ждет страшное наказание. Вера в розыгрыш быстро рушится, когда один за другим они начинают погибать … при страшных обстоятельствах.\nКто же этот «Король»? Чего он хочет? И что ждет учеников в конце этой игры..?', '2018-06-11 12:00:50', 1539, 0, 'igra-korolya', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
