(148, 0, 'Код: Осознание', 'Code: Realize', 12, '9', '1', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2010%20Code%20Realize%2FCode-Realize-PS4_07-01-17.jpg?alt=media&token=4c04a4f9-86a6-4f12-aef7-9eef833fab12', 'Кардия - девушка с трагической судьбой. Она страдает от таинственной болезни, заставляющей рассыпаться пеплом всё, к чему она прикасается. Поэтому отец наказал ей не покидать особняка, и, хотя с его исчезновения прошли годы, Кардия не смеет ослушаться. Жизнь бедняжки так и прошла бы одиноко в четырёх стенах, но однажды в дом врывается королевская гвардия и пытается увести Кардию силой. Помешать негодяям удаётся лишь загадочному вору, скрытому под маской. Теперь судьба Кардии зависит от него...', '2018-06-11 21:20:23', 1576, 0, 'kod-osoznanie', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(149, 0, 'Двуличная сестренка Умару R', 'Himouto! Umaru-chan R', 12, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fdvulichnaya-sestrenka-umaru-r%2Fthumbnail.webp?alt=media&token=d57ffcbb-1c75-40d1-8c13-8c73ba493c32', 'Безбашенная сестрёнка Умару возвращается! Для окружающих она – примерная ученица, идеальная девочка и пример для подражания. И только ее брат знает страшную тайну – какая Умару на самом деле. Запасайтесь кока-колой и чипсиками, кутайтесь в теплое одеялко и готовьтесь снова наблюдать за крышесносящими выкрутасами двуличной проказницы!', '2018-06-11 12:00:53', 805, 0, 'dvulichnaya-sestrenka-umaru-r', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(150, 0, 'Сестра - всё, что тебе нужно', 'Imoto sae Ireba Ii', 12, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2023%20Imouto%20sae%20ireba%20Ii%2FPLAKAT%20Imouto%20sae%20ireba%20ii%20(1).jpg?alt=media&token=d9f55b2d-cd45-4aea-b206-23acbfd2674d', 'Это история о повседневной жизни молодого писателя-лоликонщика Ицки Хашимы с его младшей сестрой Тихиро, гениальным иллюстратором Найту Кани, его лучшим другом Мияко Ширакавой и безумными партнерами из Издательства. ', '2018-06-11 12:00:53', 2139, 0, 'sestra-vse-chto-tebe-nuzhno', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(151, 0, 'Дети Китов', 'Kujira no Kora', 11, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2013%20Kujira%20no%20Kora%2FLes-enfants-de-la-baleine-illus-660x330.jpg?alt=media&token=97e88f83-b016-4dd8-8e09-a3ba02a84bcb', 'Четырнадцатилетний Чакуро живёт, не зная бед, на райском островке Китовая Скала - оазисе посреди бескрайней пустыни. Вместе с друзьями они порой добираются до соседних островов, ни один из которых, однако, не населён. Но всё меняется, когда Чакуро сталкивается на одном из необитаемых островков с чужой девочкой. Что ждёт Китовую Скалу теперь, и поможет ли её жителям Саймия - таинственная сила, которой с рождения наделены некоторые из них? ', '2018-06-11 12:00:55', 2968, 0, 'deti-kitov', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
