(157, 0, 'Война Двенадцати', 'Juuni Taisen', 12, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2017%20Juuni%20Taisen%2F%5BKANSAI%5D_Juuni_Taisen_TV_%5B720p%5D.torrent?alt=media&token=aa7ddd2a-6d00-4e6a-844a-8451203a33ae\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2017%20Juuni%20Taisen%2F%5BKANSAI%5D_Juuni_Taisen_TV_%5B1080p%5D.torrent?alt=media&token=dd10e210-6768-40cd-a6dd-5d81ef7cd3d1\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fvoyna-dvenadtsati%2Fthumbnail.webp?alt=media&token=7160e32f-4673-4090-8d48-500ae70dd5de', 'Двенадцать великих воинов, олицетворяющие двенадцать знаков китайского гороскопа, примут участие в смертельной схватке. Победителя состязаний ожидает награда – исполнение одного, самого заветного желания.', '2018-06-11 12:00:58', 2311, 0, 'voyna-dvenadtsati', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(158, 0, 'Инуяшики', 'Inuyashiki', 11, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2011%20Inuyashiki%2F%5BKANSAI%5D_Inuyashiki_TV_%5B720p%5D.torrent?alt=media&token=5984bf7c-7828-42b5-8d42-ed04a37731ca\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F2017%20autumn%20-%2011%20Inuyashiki%2F%5BKANSAI%5D_Inuyashiki_TV_%5B1080p%5D.torrent?alt=media&token=100d6bfa-58f6-4b27-b313-596035254fa1\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2011%20Inuyashiki%2F1503594178-eeeede1927975cc21c7bc5401b35e9ea.jpeg?alt=media&token=2d254830-579b-4c0d-bb8f-80d17a5f1aaf', '58-летний Ичиро Инуяшики - ничем не примечательный мужчина с неидеальной семьей. Врачи нашли у него рак желудка и прогнозируют, что проживет он еще месяца три. В довершение всех его бед, Ичиро убивает упавший на него инопланетный звездолет. Пришельцы не могут воскресить погибшего, но, чтобы замести следы, решают восстановить его физическую оболочку. Вскоре Ичиро понимает, что настоящий Ичиро погиб, а он сам - боевой робот-двойник оставленный пришельцами. ', '2018-06-11 12:00:59', 2824, 0, 'inuyashiki', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(159, 0, 'Лисьи Свахи', 'Enmusubi no Youko-chan', 24, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F%D0%BB%D0%B8%D1%81%D1%8C%D0%B8%20%D1%81%D0%B2%D0%B0%D1%85%D0%B8%2F%5BKANSAI%5D_Enmusubi_no_Youko-chan_%5B720p%5D.torrent?alt=media&token=c8005656-fddb-4c8c-88e0-8aa271413aea\",\"1080\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/videos%2F%D0%BB%D0%B8%D1%81%D1%8C%D0%B8%20%D1%81%D0%B2%D0%B0%D1%85%D0%B8%2F%5BKANSAI%5D_Enmusubi_no_Youko-chan_%5B1080p%5D.torrent?alt=media&token=b1a5f7c1-7684-489f-a393-799e7dcbc5ba\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2Flisandsvaha%2F0-8434000550595b9481633913.71752515.png?alt=media&token=7d7e2f79-984b-432f-af56-a5a56b02cf85', 'В этом мире лисы занимаются любовными делами, то есть работают свахами. История повествует о маленькой лисичке по имени Сусу Тушан, которая изо всех сил желает полезной — стать полноценным лисьим духом, что не просто, ведь у нее мало духовной силы и практически отсутствует лисий шарм. Ей был дан единственный шанс — первое в ее жизни задание. Однако, злобные сестрицы пытаются ей помешать. Во время выполнения задания Сусу встречает парня по имени Бай Юэчу, который доблестно берется ей помогать.', '2018-06-11 12:01:00', 2223, 0, 'lisi-svakhi', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(160, 0, 'Робомастера', 'Robomasters', 6, '0', '', '{\"720\":\"https:\\/\\/firebasestorage.googleapis.com\\/v0\\/b\\/kansai-media.appspot.com\\/o\\/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Frobomastera%2Ftorrent-720.torrent?alt=media&token=d471239f-4982-4695-aabb-10e5fa5a2cb9\"}', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2021%20Robomasters%2Fycfkz54nf2aezt9ios2n.png?alt=media&token=182beca7-554a-4054-a241-bfffcf2beb40', 'Сюжет расскажет о крупном турнире RoboMasters, в котором участвуют студенты, занимающиеся разработкой робототехники. Внимание приковано к двум группам, цель которых не просто получение призов, но еще и шанс пробиться на работу в DJI. На турнире ребята представляют своих роботов, которые будут бороться между собой.', '2018-06-11 12:01:01', 878, 0, 'robomastera', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(161, 0, 'Моя девушка - настоящая развратница', 'Boku no Kanojo ga Majime Sugiru Shojo Bitch na Ken', 10, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/titles%2F2017-%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8C%2Fmoya-devushka-nastoyaschaya-razvratnitsa%2Fthumbnail.webp?alt=media&token=2ad366a2-c443-474c-a48c-9b4d68e984d2', 'Обыкновенный японский школьник Харука Шинозаки признаётся в любви Акихо Косаке - недосягаемой школьной старосте. И - о чудо - его богиня готова с ним встречаться! Вот только энтузиазм Харуки угасает всё больше, по мере того как раскрывается страшная правда: его новая девушка имеет очень странные представления об отношениях. И охарактеризовать её концепцию можно фразой: \"Чем развратней - тем лучше!\"', '2018-06-11 12:01:02', 1393, 0, 'moya-devushka-nastoyaschaya-razvratnitsa', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]'),
(162, 0, 'Орган Геноцида', 'Gyakusatsu Kikan', 1, '0', '', '[]', 'https://firebasestorage.googleapis.com/v0/b/kansai-media.appspot.com/o/videos%2F2017%20autumn%20-%2026%20Gyakusatsu%20Kikan%2FMV5BNjQ0N2JjNDItZWJlMS00MmM3LTk3ZTgtNzQ5YzIwODY5ZjQ2XkEyXkFqcGdeQXVyNjY3MDE3NDM%40._V1_.jpg?alt=media&token=bf0045be-362c-45fa-8fb8-d2e57a7a49b0', 'Разразилась война с террором. Буквально за день Сараево было уничтожено самодельным ядерным устройством. Ведущие демократические государства превращаются в государства тотального надзора, и развивающийся мир захлебывается под волной геноцида. Похоже, за разрушением мировой системы стоит таинственный американец Джон Пол. На агента разведки Клэвиса Шепарда возложена задача выследить в руинах цивилизации Джона Пола и найти истинное сердце тьмы — Орган Геноцида.', '2018-06-11 18:41:41', 3645, 0, 'organ-genotsida', '[{\"key\":\"\\u0413\\u043e\\u0434 \\u0432\\u044b\\u043f\\u0443\\u0441\\u043a\\u0430\",\"value\":2017,\"ishidden\":\"on\"}]');
